INSERT INTO `article` VALUES (1, 'Element-plus的Date Picker组件输出日期慢8小时解决方法', '<p>通过把<strong> value-format </strong>的值设置成<strong> &nbsp;\"YYYY-MM-DD[T]HH:mm:ss.sss[Z]\"</strong></p><pre><code class=\"language-html\">&lt;el-date-picker value-format=\"YYYY-MM-DD[T]HH:mm:ss.sss[Z]\" /&gt;</code></pre><p> </p>', '通过把 value-format 的值设置成  \"YYYY-MM-DD[T]HH:mm:ss.sss[Z]\"\n<el-date-picker value-format=\"YYYY-MM-DD[T]HH:mm:ss.sss[Z]\" />\n ', '2025/05/11/94559419-e3e1-4bac-b1b5-f57973b7cb9e.webp', 1, 'qxfly', '2025-01-01 22:00:14', '2025-05-11 13:20:48', 9, 0, 0, 'Vue,HTML,JavaScript', 3, '编程', 11);
INSERT INTO `article` VALUES (2, 'SpringBoot虚拟路径配置，解决无法访问静态资源的问题 404', '<ul><li>解决无法访问静态资源的问题 404</li><li>解决 Springboot 上传图片无法回显而且浏览器页面显示 404 无法找到文件的路径。</li></ul><h3 style=\"text-align: center;\"><strong>使用 WebMvcConfigurer 接口重写 addResourceHandlers 方法。</strong></h3><pre><code class=\"language-java\">import org.springframework.beans.factory.annotation.Value;\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.web.servlet.config.annotation.ResourceHandlerRegistry;\nimport org.springframework.web.servlet.config.annotation.WebMvcConfigurer;\n\n@Configuration\npublic class VirtualPathConfig implements WebMvcConfigurer {\n    /**\n     * Value值可以通过在配置文件 application.properties\n     * 配置 VirtualPath=file:///D:/upload2/ 来配置\n     * @Value(\"${VirtualPath}\") 来获取值\n     *\n     * 也可以通过字符串配置\n     * @Value(\"file:///D:/upload2/\")\n     */\n    @Value(\"${VirtualPath}\")\n    private String filePath;\n\n    @Override\n    public void addResourceHandlers(ResourceHandlerRegistry registry) {\n        /*\n          资源映射路径\n          addResourceHandler：访问映射路径 https://qxfly.fun/download/**\n          addResourceLocations：资源绝对路径 文件原始绝对路径\n         */\n        registry.addResourceHandler(\"/download/**\")\n                .addResourceLocations(filePath);\n    }\n}</code></pre><p><br></p>', '解决无法访问静态资源的问题 404\n解决 Springboot 上传图片无法回显而且浏览器页面显示 404 无法找到文件的路径。\n使用 WebMvcConfigurer 接口重写 addResourceHandlers 方法。\nimport org.springframework.beans.factory.annotation.Value;\nimport org.springframework.context.annotation.Configuration;\nimport org.sprin', '2025/02/05/01e57c06-49a7-417a-899e-6c762263df1d.webp', 1, 'qxfly', '2025-01-02 19:31:14', '2025-01-02 19:31:14', 8, 1, 2, 'Java,SpringBoot,后端', 3, '编程', 11);
INSERT INTO `article` VALUES (3, 'SpringBoot解决跨域问题', '<h2 style=\"text-align: start;\">1、使用 Filter 方式进行设置</h2><blockquote style=\"text-align: start;\">使用 Filter 过滤器来过滤服务请求，向请求端设置 Response Header(响应头部)的 Access-Control-Allow-Origin 属性声明允许跨域访问。</blockquote><pre style=\"text-align: left;\"><code class=\"language-java\">@WebFilter\npublic class CorsFilter implements Filter {\n\n    @Override\n    public void doFilter(ServletRequest req, ServletResponse res, FilterChain chain) throws IOException, ServletException {\n        HttpServletResponse response = (HttpServletResponse) res;\n        response.setHeader(\"Access-Control-Allow-Origin\", \"*\");\n        response.setHeader(\"Access-Control-Allow-Methods\", \"*\");\n        response.setHeader(\"Access-Control-Max-Age\", \"3600\");\n        response.setHeader(\"Access-Control-Allow-Headers\", \"*\");\n        response.setHeader(\"Access-Control-Allow-Credentials\", \"true\");\n        chain.doFilter(req, res);\n    }\n}</code></pre><h2 style=\"text-align: start;\">2、继承 HandlerInterceptorAdapter</h2><pre><code class=\"language-java\">@Component\npublic class CrossInterceptor extends HandlerInterceptorAdapter {\n\n    @Override\n    public boolean preHandle(HttpServletRequest request, HttpServletResponse response, Object handler) throws Exception {\n        response.setHeader(\"Access-Control-Allow-Origin\", \"*\");\n        response.setHeader(\"Access-Control-Allow-Methods\", \"GET, POST, PUT, DELETE, OPTIONS\");\n        response.setHeader(\"Access-Control-Max-Age\", \"3600\");\n        response.setHeader(\"Access-Control-Allow-Headers\", \"*\");\n        response.setHeader(\"Access-Control-Allow-Credentials\", \"true\");\n        return true;\n    }\n}</code></pre><h2 style=\"text-align: start;\">3、实现 WebMvcConfigurer 解决跨域问题</h2><pre><code class=\"language-java\">import org.springframework.context.annotation.Configuration;\nimport org.springframework.web.servlet.config.annotation.CorsRegistry;\nimport org.springframework.web.servlet.config.annotation.WebMvcConfigurer;\n\n/*解决跨域问题*/\n@Configuration\npublic class CORSConfig implements WebMvcConfigurer {\n\n    public void addCorsMappings(CorsRegistry registry) {\n        // 设置允许跨域的路径\n        registry.addMapping(\"/**\")\n                // 设置允许跨域请求的域名 * 为全部\n                .allowedOriginPatterns(\"http://www.abc.com\")\n                // 是否允许cookie\n                .allowCredentials(true)\n                // 设置允许的请求方式\n                .allowedMethods(\"GET\", \"POST\", \"DELETE\", \"PUT\")\n                // 设置允许的header属性\n                .allowedHeaders(\"*\")\n                // 跨域允许时间\n                .maxAge(3600);\n    }\n}</code></pre><h2 style=\"text-align: start;\">4、使用 Nginx 配置</h2><pre><code >location / {\n   add_header Access-Control-Allow-Origin *;\n   add_header Access-Control-Allow-Headers X-Requested-With;\n   add_header Access-Control-Allow-Methods GET,POST,PUT,DELETE,OPTIONS;\n\n   if ($request_method = \'OPTIONS\') {\n     return 204;\n   }\n}</code></pre><h2 style=\"text-align: start;\">5、使用 @CrossOrgin 注解</h2><blockquote style=\"text-align: start;\">如果只是想部分接口跨域，且不想使用配置来管理的话，可以使用这种方式</blockquote><p style=\"text-align: start;\">在 Controller 使用</p><pre style=\"text-align: left;\"><code class=\"language-java\">@CrossOrigin\n@RestController\n@RequestMapping(\"/user\")\npublic class UserController {\n\n    @GetMapping(\"/{id}\")\n    public User get(@PathVariable Long id) {\n\n    }\n\n    @DeleteMapping(\"/{id}\")\n    public void remove(@PathVariable Long id) {\n\n    }\n\n}</code></pre><p style=\"text-align: start;\">在具体接口上使用</p><pre><code class=\"language-java\">@RestController\n@RequestMapping(\"/user\")\npublic class UserController {\n\n    @CrossOrigin\n    @GetMapping(\"/{id}\")\n    public User get(@PathVariable Long id) {\n\n    }\n\n    @DeleteMapping(\"/{id}\")\n    public void remove(@PathVariable Long id) {\n\n    }\n\n}</code></pre><p><br></p>', '1、使用 Filter 方式进行设置\n使用 Filter 过滤器来过滤服务请求，向请求端设置 Response Header(响应头部)的 Access-Control-Allow-Origin 属性声明允许跨域访问。\n@WebFilter\npublic class CorsFilter implements Filter {\n\n    @Override\n    public void doFilter(ServletRequest req, ServletResponse res, Filt', '2025/05/11/fb0145d2-6f42-48f6-9f9f-0b18d813b339.webp', 1, 'qxfly', '2025-01-03 19:42:31', '2025-05-11 13:20:28', 9, 0, 0, 'Java,后端,SpringBoot', 3, '编程', 11);
INSERT INTO `article` VALUES (4, 'SpringBoot 过滤拦截器 interceptor 的使用', '<h3>1、注册配置拦截器：实现 WebMvcConfigurer 接口，并重写 addInterceptors 方法</h3><pre><code class=\"language-java\">package top.qxfly.config;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.web.servlet.config.annotation.InterceptorRegistry;\nimport org.springframework.web.servlet.config.annotation.WebMvcConfigurer;\nimport top.qxfly.interceptor.LoginCheckInterceptor;\n\n@Configuration\npublic class WebConfig implements WebMvcConfigurer {\n    @Autowired\n    private LoginCheckInterceptor loginCheckInterceptor;\n\n    @Override\n    public void addInterceptors(InterceptorRegistry registry) {\n        registry.addInterceptor(loginCheckInterceptor).addPathPatterns(\"/**\");\n    }\n}\n</code></pre><h3>2、自定义拦截器：实现 HandlerInterceptor 接口，并重写其所有方法</h3><pre><code class=\"language-java\">import jakarta.servlet.http.HttpServletRequest;\nimport jakarta.servlet.http.HttpServletResponse;\nimport lombok.extern.slf4j.Slf4j;\nimport org.springframework.stereotype.Component;\nimport org.springframework.web.bind.annotation.CrossOrigin;\nimport org.springframework.web.servlet.HandlerInterceptor;\nimport org.springframework.web.servlet.ModelAndView;\n@CrossOrigin\n@Slf4j\n@Component\npublic class awd implements HandlerInterceptor {\n    @Override //目标资源方法运行前运行，返回true:放行，返回false:不放行\n    public boolean preHandle(HttpServletRequest req, HttpServletResponse resp, Object handler) throws Exception {\n        HandlerInterceptor.super.preHandle(req,resp,handler);\n        return true;\n    }\n\n    @Override //目标资源运行后运行\n    public void postHandle(HttpServletRequest request, HttpServletResponse response, Object handler, ModelAndView modelAndView) throws Exception {\n        HandlerInterceptor.super.postHandle(request, response, handler, modelAndView);\n    }\n\n    @Override //试图渲染完毕后运行\n    public void afterCompletion(HttpServletRequest request, HttpServletResponse response, Object handler, Exception ex) throws Exception {\n        HandlerInterceptor.super.afterCompletion(request, response, handler, ex);\n    }\n}</code></pre><h3 style=\"text-align: start;\">具体示例</h3><blockquote style=\"text-align: start;\">创建 LoginCheckInterceptor 类 （类名自定义）并实现 HandlerInterceptor 接口，并重写其所有方法</blockquote><pre><code class=\"language-java\">package top.qxfly.interceptor;\n\nimport com.alibaba.fastjson.JSONObject;\nimport jakarta.servlet.http.HttpServletRequest;\nimport jakarta.servlet.http.HttpServletResponse;\nimport lombok.extern.slf4j.Slf4j;\nimport org.springframework.http.HttpMethod;\nimport org.springframework.stereotype.Component;\nimport org.springframework.util.StringUtils;\nimport org.springframework.web.bind.annotation.CrossOrigin;\nimport org.springframework.web.servlet.HandlerInterceptor;\nimport org.springframework.web.servlet.ModelAndView;\nimport top.qxfly.pojo.Result;\nimport top.qxfly.utils.JwtUtils;\n\n@CrossOrigin\n@Slf4j\n@Component\npublic class LoginCheckInterceptor implements HandlerInterceptor {\n\n    //目标资源方法运行前运行，返回true:放行，返回false:不放行\n    @Override\n    public boolean preHandle(HttpServletRequest req, HttpServletResponse resp, Object handler) throws Exception {\n        // 放行 OPTIONS请求\n        if (HttpMethod.OPTIONS.toString().equals(req.getMethod())) {\n            log.info(\"OPTIONS请求，放行\");\n            return true;\n        }\n\n        //获取请求的url\n        String url = req.getRequestURI();\n        log.info(\"请求的url:{}\", url);\n\n        /**\n         * 把不需要拦截的请求地址放入数组\n         * 判断是否为在数组里,如果是放行\n         */\n        String[] urllist = {\"login\", \"logout\", \"register\",\"listfile\", \"loginStatue\", \"updateLoginStatue\", \"download\", \"fileList\", \"listWord\"};\n        for (String s : urllist) {\n            /*log.info(\"urllist{}\", s);*/\n            if (url.contains(s)) {\n                log.info(\"该url无需验证：{}\", url);\n                return true;\n            }\n        }\n\n\n        //获取证书token\n        String jwt = req.getHeader(\"token\");\n        //判断证书是否存在，如果不存在，返回错误结果（未登录）\n        if (!StringUtils.hasLength(jwt)) {\n            log.info(\"请求头token为空，返回未登入信息\");\n            Result error = Result.error(\"NOT_LOGIN\");\n            //转换为json对象\n            String notlogin = JSONObject.toJSONString(error);\n            resp.getWriter().write(notlogin);\n            return false;\n        }\n\n        //解析token，解析失败，返回错误结果（未登录）\n        try {\n            JwtUtils.parseJWT(jwt);\n        } catch (Exception e) {\n            e.printStackTrace();\n            log.info(\"解析证书失败，未登录\");\n            Result error = Result.error(\"NOT_LOGIN\");\n            //转换为json对象\n            String notlogin = JSONObject.toJSONString(error);\n            resp.getWriter().write(notlogin);\n            return false;\n        }\n\n        //放行\n        log.info(\"证书合法，放行\");\n        return true;\n    }\n\n\n    @Override //目标资源运行后运行\n    public void postHandle(HttpServletRequest request, HttpServletResponse response, Object handler, ModelAndView modelAndView) throws Exception {\n        HandlerInterceptor.super.postHandle(request, response, handler, modelAndView);\n    }\n\n    @Override //试图渲染完毕后运行\n    public void afterCompletion(HttpServletRequest request, HttpServletResponse response, Object handler, Exception ex) throws Exception {\n        HandlerInterceptor.super.afterCompletion(request, response, handler, ex);\n    }\n}</code></pre><p><br></p>', '1、注册配置拦截器：实现 WebMvcConfigurer 接口，并重写 addInterceptors 方法\npackage top.qxfly.config;\n\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.context.annotation.Configuration;\nimport org.springframework.web.servlet.conf', '2025/02/05/b6b730ff-72a3-46c3-9cd0-788990982d23.webp', 1, 'qxfly', '2025-01-04 19:51:48', '2025-01-04 19:51:48', 17, 3, 9, 'Java,SpringBoot,后端', 3, '编程', 11);
INSERT INTO `article` VALUES (5, '基于Java+Vue的RSA非对称加密处理的实现', '<h1>RSA加密</h1><blockquote>​ RSA加密是一个非对称加密，它包括了一对私钥和公钥，公钥是公开出去的，私钥是保密的。公钥加密的内容需要用私钥解密。基于这个特性对于密码加密有了新的思路：vue对密码进行公钥加密，通过ajax请求将密文传入后端，后端使用私钥解密。</blockquote><h2>后端</h2><p><strong>1、安装maven依赖</strong></p><pre><code class=\"language-xml\">&lt;dependency&gt;\n  &lt;groupId&gt;commons-codec&lt;/groupId&gt;\n  &lt;artifactId&gt;commons-codec&lt;/artifactId&gt;\n  &lt;version&gt;1.15&lt;/version&gt;\n&lt;/dependency&gt;\n\n</code></pre><p style=\"text-align: left;\"><strong>2、创建生成公钥-私钥的Java文件</strong></p><pre><code class=\"language-java\">\npublic class RSAEncrypt {\n\n    /**\n     * 随机生成密钥对\n     *\n     * @return map存公钥秘钥；key:0 -公钥  ；key:1 -私钥\n     * @throws NoSuchAlgorithmException\n     */\n    public static Map&lt;Integer, String&gt; genKeyPair() throws NoSuchAlgorithmException {\n        Map&lt;Integer, String&gt; result = new HashMap&lt;&gt;();\n        // KeyPairGenerator类用于生成公钥和私钥对，基于RSA算法生成对象\n        KeyPairGenerator keyPairGen = KeyPairGenerator.getInstance(\"RSA\");\n        // 初始化密钥对生成器，密钥大小为96-1024位\n        keyPairGen.initialize(1024, new SecureRandom());\n        // 生成一个密钥对，保存在keyPair中\n        KeyPair keyPair = keyPairGen.generateKeyPair();\n        RSAPrivateKey privateKey = (RSAPrivateKey) keyPair.getPrivate();   // 得到私钥\n        RSAPublicKey publicKey = (RSAPublicKey) keyPair.getPublic();  // 得到公钥\n        String publicKeyString = new String(Base64.encodeBase64(publicKey.getEncoded(), true));\n        // 得到私钥字符串\n        String privateKeyString = new String(Base64.encodeBase64(privateKey.getEncoded(), true));\n        // 将公钥和私钥保存到Map\n        result.put(0, publicKeyString);  //0表示公钥\n        result.put(1, privateKeyString);  //1表示私钥\n        return result;\n    }\n\n    /**\n     * RSA公钥加密\n     *\n     * @param str       加密字符串\n     * @param publicKey 公钥\n     * @return 密文\n     * @throws Exception 加密过程中的异常信息\n     */\n    public static String encrypt(String str, String publicKey) throws Exception {\n        //base64编码的公钥\n        byte[] decoded = Base64.decodeBase64(publicKey);\n        RSAPublicKey pubKey = (RSAPublicKey) KeyFactory.getInstance(\"RSA\").generatePublic(new X509EncodedKeySpec(decoded));\n        //RSA加密\n        Cipher cipher = Cipher.getInstance(\"RSA\");\n        cipher.init(Cipher.ENCRYPT_MODE, pubKey);\n        return Base64.encodeBase64String(cipher.doFinal(str.getBytes(\"UTF-8\")));\n    }\n\n    /**\n     * RSA私钥解密\n     *\n     * @param str        加密字符串\n     * @param privateKey 私钥\n     * @return 明文\n     * @throws Exception 解密过程中的异常信息\n     */\n    public static String decrypt(String str, String privateKey) throws Exception {\n        //64位解码加密后的字符串\n        byte[] inputByte = Base64.decodeBase64(str);\n        //base64编码的私钥\n        byte[] decoded = Base64.decodeBase64(privateKey);\n        RSAPrivateKey priKey = (RSAPrivateKey) KeyFactory.getInstance(\"RSA\").generatePrivate(new PKCS8EncodedKeySpec(decoded));\n        //RSA解密\n        Cipher cipher = Cipher.getInstance(\"RSA\");\n        cipher.init(Cipher.DECRYPT_MODE, priKey);\n        return new String(cipher.doFinal(inputByte));\n    }\n\n\n    /**\n     * RSA私钥加密\n     *\n     * @param str        加密字符串\n     * @param privateKey 私钥\n     * @return 密文\n     * @throws Exception 加密过程中的异常信息\n     */\n    public static String encryptByPrivate(String str, String privateKey) throws Exception {\n        //base64编码的公钥\n        byte[] decoded = Base64.decodeBase64(privateKey);\n        RSAPrivateKey pubKey = (RSAPrivateKey) KeyFactory.getInstance(\"RSA\").generatePrivate(new PKCS8EncodedKeySpec(decoded));\n        //RSA加密\n        Cipher cipher = Cipher.getInstance(\"RSA\");\n        cipher.init(Cipher.ENCRYPT_MODE, pubKey);\n//        String outStr = java.util.Base64.getEncoder().encodeToString(cipher.doFinal(str.getBytes(\"UTF-8\")));\n        return Base64.encodeBase64String(cipher.doFinal(str.getBytes(\"UTF-8\")));\n    }\n\n    /**\n     * RSA公钥解密\n     *\n     * @param str       加密字符串\n     * @param publicKey 公钥\n     * @return 明文\n     * @throws Exception 加密过程中的异常信息\n     */\n    public static String decryptByPublicKey(String str, String publicKey) throws Exception {\n        //64位解码加密后的字符串\n        byte[] inputByte = Base64.decodeBase64(str);\n        //base64编码的私钥\n        byte[] decoded = Base64.decodeBase64(publicKey);\n        RSAPublicKey priKey = (RSAPublicKey) KeyFactory.getInstance(\"RSA\").generatePublic(new X509EncodedKeySpec(decoded));\n        //RSA解密\n        Cipher cipher = Cipher.getInstance(\"RSA\");\n        cipher.init(Cipher.DECRYPT_MODE, priKey);\n        return new String(cipher.doFinal(inputByte));\n    }\n\n\n    public static void main(String[] args) throws Exception {\n        //生成公钥和私钥\n        Map&lt;Integer, String&gt; keyMap = genKeyPair();\n        //加密字符串\n        String message = \"什么是快乐\";\n        System.out.println(\"随机生成的公钥为:\" + keyMap.get(0));\n        System.out.println(\"随机生成的私钥为:\" + keyMap.get(1));\n        String messageEn = encrypt(message, keyMap.get(0));\n        String messageEn2 = decrypt(messageEn, keyMap.get(1));\n        System.out.println(messageEn);\n        System.out.println(messageEn2);\n    }\n}\n\n</code></pre><h2>前端</h2><p><strong>1、安装依赖包</strong></p><pre><code class=\"language-javascript\">npm i jsencrypt -S\nnpm i encryptlong -S</code></pre><p><strong>2、创建一个js文件</strong></p><pre><code class=\"language-javascript\">/* 产引入jsencrypt实现数据RSA加密 */\nimport JSEncrypt from \"jsencrypt\"; // 处理长文本数据时报错 jsencrypt.js Message too long for RSA\n/* 产引入encryptlong实现数据RSA加密 */\nimport Encrypt from \"encryptlong\"; // encryptlong是基于jsencrypt扩展的长文本分段加解密功能。\n\n//加密，公钥加密\nexport function encrypt(data, publicKey) {\n  var encryptor = new Encrypt();\n  encryptor.setPublicKey(publicKey);\n  // 如果是对象/数组的话，需要先JSON.stringify转换成字符串\n  const result = encryptor.encryptLong(data);\n  return result;\n}\nexport function decrypt(data, publicKey) {\n  var encryptor = new Encrypt();\n  encryptor.setPrivateKey(publicKey);\n  // 如果是对象/数组的话，需要先JSON.stringify转换成字符串\n  var result = encryptor.decryptLong(data);\n  return result;\n}\n</code></pre><p><strong>3、在组件中使用</strong></p><pre><code class=\"language-javascript\">import { encrypt } from \"@/utils/RSA\";</code></pre><p><br></p>', 'RSA加密\n​ RSA加密是一个非对称加密，它包括了一对私钥和公钥，公钥是公开出去的，私钥是保密的。公钥加密的内容需要用私钥解密。基于这个特性对于密码加密有了新的思路：vue对密码进行公钥加密，通过ajax请求将密文传入后端，后端使用私钥解密。\n后端\n1、安装maven依赖\n<dependency>\n  <groupId>commons-codec</groupId>\n  <artifactId>commons-codec</artifactId>\n  <version>1.15</versio', '2025/02/05/1a47853f-5297-4b7b-bc92-48b7d3ecd07b.webp', 1, 'qxfly', '2025-01-06 21:45:43', '2025-01-06 21:45:43', 36, 4, 9, 'Java,SpringBoot,Vue', 3, '编程', 11);
INSERT INTO `article` VALUES (6, 'java实现多线程的四种方法', '<ol><li>继承Thread类</li><li>实现Runnable接口</li><li>实现Callable接口</li><li>线程池：<span style=\"color: rgb(0, 0, 0); background-color: rgba(255, 255, 255, 0.5); font-size: 14px;\">提供了一个线程队列，队列中保存着所有等待状态的线程。避免了创建与销毁额外开销，提高了响应的速度。</span></li></ol><h2>1、继承Thread类</h2><pre><code class=\"language-java\">package fun.qxfly;\n\npublic class MyThread_Extends extends Thread {\n    public MyThread_Extends(String name) {\n        this.setName(name);\n    }\n\n    @Override\n    public void run() {\n        for (int i = 0; i &lt; 100; i++) {\n            System.out.println(Thread.currentThread().getName() + \":MyThread\");\n        }\n    }\n\n    public static void main(String[] args) {\n        MyThread_Extends myThreadExtends1 = new MyThread_Extends(\"线程1：\");\n        myThreadExtends1.start();\n        MyThread_Extends myThread2 = new MyThread_Extends(\"线程2：\");\n        myThread2.start();\n    }\n}\n\n</code></pre><h2>2、实现Runnable接口</h2><pre><code class=\"language-java\">package fun.qxfly;\n\npublic class MyThread_Runnable implements Runnable {\n\n    @Override\n    public void run() {\n        for (int i = 0; i &lt; 100; i++) {\n            System.out.println(Thread.currentThread().getName() + \":MyThread\");\n        }\n    }\n\n    public static void main(String[] args) {\n        Thread thread1 = new Thread(new MyThread_Runnable(), \"线程1\");\n        thread1.start();\n        Thread thread2 = new Thread(new MyThread_Runnable(), \"线程2\");\n        thread2.start();\n    }\n}\n</code></pre><h2>3、实现Callable接口</h2><pre><code class=\"language-java\">package fun.qxfly;\n\nimport java.util.concurrent.Callable;\nimport java.util.concurrent.FutureTask;\n\npublic class MyThread_Callable implements Callable&lt;Object&gt; {\n    @Override\n    public String call() throws Exception {\n        for (int i = 0; i &lt; 100; i++) {\n            System.out.println(Thread.currentThread().getName() + \":MyThread\");\n        }\n        return null;\n    }\n\n\n}\n</code></pre><p style=\"text-indent: 2em;\"><strong>执行方式1：使用FutureTask</strong></p><pre><code class=\"language-java\">public static void main(String[] args) throws Exception {\n        Callable&lt;Object&gt; callable1 = new MyThread_Callable();\n        Callable&lt;Object&gt; callable2 = new MyThread_Callable();\n        FutureTask&lt;Object&gt; futureTask1 = new FutureTask&lt;&gt;(callable1);\n        FutureTask&lt;Object&gt; futureTask2 = new FutureTask&lt;&gt;(callable2);\n        new Thread(futureTask1,\"线程1\").start();\n        new Thread(futureTask2,\"线程1\").start();\n    }</code></pre><p style=\"text-indent: 2em;\"><strong>执行方式2：使用线程池</strong></p><pre><code class=\"language-java\">public static void main(String[] args) throws Exception {\n        Callable&lt;Object&gt; callable1 = new MyThread_Callable();\n        Callable&lt;Object&gt; callable2 = new MyThread_Callable();\n\n        ExecutorService executorService = Executors.newFixedThreadPool(10);\n        executorService.submit(callable1);\n        executorService.submit(callable2);\n        \n        executorService.shutdown();\n    }</code></pre><h2>4、线程池</h2><pre><code class=\"language-java\">package fun.qxfly;\n\nimport java.util.concurrent.ExecutorService;\nimport java.util.concurrent.Executors;\n\npublic class MyThread_Pool {\n    public static void main(String[] args) {\n        ExecutorService executorService = Executors.newFixedThreadPool(10);\n        executorService.submit(new MyThread_Extends(\"线程1\"));\n        executorService.submit(new MyThread_Extends(\"线程2\"));\n        executorService.shutdown();\n    }\n}\n</code></pre><p><br></p>', '继承Thread类\n实现Runnable接口\n实现Callable接口\n线程池：提供了一个线程队列，队列中保存着所有等待状态的线程。避免了创建与销毁额外开销，提高了响应的速度。\n1、继承Thread类\npackage fun.qxfly;\n\npublic class MyThread_Extends extends Thread {\n    public MyThread_Extends(String name) {\n        this.setName(name);\n    }\n\n    ', '2025/05/11/92725b25-cd17-495a-ad27-98663f351a66.webp', 1, 'qxfly', '2025-01-08 19:26:18', '2025-05-11 13:20:07', 18, 1, 1, 'Java,SpringBoot', 3, '编程', 11);
INSERT INTO `article` VALUES (8, 'test用户测试文章', '<p><br></p><h2 style=\"text-align: start;\">带参数的动态路由匹配</h2><p style=\"text-align: start;\"><br></p><p style=\"text-align: start;\">很多时候，我们需要将给定<a href=\"https://so.csdn.net/so/search?q=%E5%8C%B9%E9%85%8D%E6%A8%A1%E5%BC%8F&amp;spm=1001.2101.3001.7020\" target=\"_blank\">匹配模式</a>的路由映射到同一个组件。例如，我们可能有一个 <span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>User</code></span> 组件，它应该对所有<a href=\"https://so.csdn.net/so/search?q=%E7%94%A8%E6%88%B7&amp;spm=1001.2101.3001.7020\" target=\"_blank\">用户</a>进行渲染，但用户 ID 不同。在 Vue Router 中，我们可以在路径中使用一个动态字段来实现，我们称之为 <em>路径参数</em> ：</p><pre><code class=\"language-javascript\">const User = {\n  template: \'&lt;div&gt;User&lt;/div&gt;\',\n}\n\n// 这些都会传递给 `createRouter`\nconst routes = [\n  // 动态字段以冒号开始\n  { path: \'/users/:id\', component: User },\n]</code></pre><p>现在像<span style=\"color: rgb(247, 89, 171); background-color: rgb(246, 226, 234);\">/users/johnny </span>和 <span style=\"background-color: rgb(255, 213, 145);\">/users/jolyne</span> 这样的 URL 都会映射到同一个路由。</p><p>路径参数 用冒号 : 表示。当一个路由被匹配时，它的 params 的值将在每个组件中以 this.$route.params 的形式暴露出来。因此，我们可以通过更新 User 的模板来呈现当前的用户 ID：</p><p>你可以在同一个路由中设置有多个 路径参数，它们会映射到 $route.params 上的相应字段。例如：</p><p><br></p><p>匹配模式	匹配路径	$route.params</p><table style=\"width: 100%;\"><tbody><tr><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">匹配模式</th><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">匹配路径</th><th colSpan=\"1\" rowSpan=\"1\" width=\"auto\">$route.params</th></tr><tr><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">/users/:username</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">/users/eduardo</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">{ username: \'eduardo\' }</td></tr><tr><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">/users/:username/posts/:postId</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">/users/eduardo/posts/123</td><td colSpan=\"1\" rowSpan=\"1\" width=\"auto\">{ username: \'eduardo\' }</td></tr></tbody></table><p>除了 $route.params 之外，$route 对象还公开了其他有用的信息，如 $route.query（如果 URL 中存在参数）、$route.hash 等。你可以在 API 参考中查看完整的细节。</p><p>这个例子的 demo 可以在这里找到。</p>', '\n带参数的动态路由匹配\n\n很多时候，我们需要将给定匹配模式的路由映射到同一个组件。例如，我们可能有一个 User 组件，它应该对所有用户进行渲染，但用户 ID 不同。在 Vue Router 中，我们可以在路径中使用一个动态字段来实现，我们称之为 路径参数 ：\nconst User = {\n  template: \'<div>User</div>\',\n}\n\n// 这些都会传递给 `createRouter`\nconst routes = [\n  // 动态字段以冒号开始\n  { path: \'/', '2025/02/05/7b2bccba-fbb9-4c21-8fc2-96f8928c6b44.webp', 2, 'test', '2025-01-09 07:24:52', '2025-01-09 07:24:52', 5, 6, 8, '', 3, NULL, 11);
INSERT INTO `article` VALUES (104, 'python数据分析练习题', '<p>python数据分析练习题</p><pre><code class=\"language-python\">import numpy as np\nimport pandas as pd\nimport matplotlib.pyplot as plt\ndf = pd.read_csv(\'data/house_data.txt\',sep=\",\", header=0)\nplt.scatter(df[\'area\'],df[\'price\'],c=\'b\')\ndf = (df - df.min()) / (df.max() - df.min())\ntrain_data = df.sample(frac = 0.8, replace = False)\ntest_data = df.drop(train_data.index)\nx_train = train_data[\'area\'].values.reshape (-1,1)\ny_train = train_data[\'price\'].values\nx_test = test_data[\'area\'].values.reshape(-1,1)\ny_test = test_data[\'price\'].values\n\n\nfrom sklearn.linear_model import SGDRegressor\nimport joblib\nmodel = SGDRegressor (max_iter=500, learning_rate=\'optimal\', eta0=0.01)\nmodel.fit(x_train, y_train)\npre_score = model.score (x_train,y_train)\nprint(\'score=\', pre_score)\nprint(\'coef=\', model.coef_, \'intercept=\', model.intercept_)\njoblib.dump(model,\'data/SGDRegressor.model\')\n\n\nmodel=joblib.load(\'data/SGDRegressor.model\')\ny_pred=model.predict(x_test)#得到预测集\nprint(\'测试集准确率得分=%.5f\'%model.score(x_test, y_test))\nMSE = np.mean((y_test - y_pred) ** 2)\nprint(\'损失MSE={:.5f}\'.format(MSE))\n\n\nplt.rcParams[\'font.sans-serif\'] = [\'SimHei\'] \nplt.figure(figsize = (10,4))\naxl = plt.subplot(121)\nplt.scatter(x_test, y_test, label = \'测试集\')\nplt.plot(x_test, y_pred, \'r\', label = \'预测回归线\')\naxl.set_xlabel(\'面积\')\naxl.set_ylabel(\'价格\') \nplt.legend(loc = \'upper left\') \nax2 = plt.subplot(122)\nx = range(0,len(y_test))\nplt.plot(x,y_test, \'g\', label = \'真实值\')\nplt.plot(x,y_pred, \'r\', label = \'预测值\')\nax2.set_xlabel(\'样本序号\')\nax2.set_ylabel(\'价格\')\nplt.legend(loc = \'upper right\')</code></pre><p><br></p>', 'python数据分析练习题\nimport numpy as np\nimport pandas as pd\nimport matplotlib.pyplot as plt\ndf = pd.read_csv(\'data/house_data.txt\',sep=\",\", header=0)\nplt.scatter(df[\'area\'],df[\'price\'],c=\'b\')\ndf = (df - df.min()) / (df.max() - df.min())\ntrain_data = df.samp', '2025/05/11/bdce5a5d-9dc1-4f53-8d86-9fcdb8f468d5.webp', 1, 'qxfly', '2025-02-06 11:18:12', '2025-05-11 13:19:55', 3, 1, 1, 'Python,人工智能,大数据', 3, 'AI', 11);
INSERT INTO `article` VALUES (105, 'Centos7安装Java17', '<p>1、使用wget下载openJdk</p><pre><code >wget https://download.oracle.com/java/17/latest/jdk-17_linux-x64_bin.rpm</code></pre><p>2、<span style=\"color: rgb(25, 26, 36); background-color: rgb(255, 255, 255); font-size: 14px;\">使用 rpm 命令安装下载的 JDK 17 二进制文件</span></p><pre><code >rpm -ivh jdk-17_linux-x64_bin.rpm</code></pre><p style=\"text-align: left;\">3、如果遇到一些依赖问题，例如，如果系统缺少 libaio 或 libaio1，可以使用以下命令进行安装：</p><pre style=\"text-align: left;\"><code>sudo yum install libaio libaio-devel</code></pre><p>4、完成后查看版本</p><pre><code >java -version</code></pre><p><br></p>', '1、使用wget下载openJdk\nwget https://download.oracle.com/java/17/latest/jdk-17_linux-x64_bin.rpm\n2、使用 rpm 命令安装下载的 JDK 17 二进制文件\nrpm -ivh jdk-17_linux-x64_bin.rpm\n3、如果遇到一些依赖问题，例如，如果系统缺少 libaio 或 libaio1，可以使用以下命令进行安装：\nsudo yum install libaio libaio-devel\n4、完成', '2025/05/11/9e1c994b-eb2c-4d30-9c2e-5b60a9037f94.webp', 1, 'qxfly', '2025-02-07 12:58:17', '2025-05-11 13:19:37', 4, 2, 4, 'Java,服务器,操作系统,Centos', 3, '操作系统', 11);
INSERT INTO `article` VALUES (115, '基础算法：完数', '<h1 style=\"text-align: start;\">二、完数</h1><h3 style=\"text-align: start;\"> 概念：</h3><blockquote style=\"text-align: start;\">完全数（Perfect number），又称完美数或完备数，是一些特殊的自然数。它所有的真因子（即除了自身以外的约数）的和（即因子函数），恰好等于它本身。 例如： 6 的因子有：1 2 3 它们的和：1 + 2 + 3 = 6 所以 6 为完数</blockquote><h3 style=\"text-align: start;\"> 示例：</h3><p> &nbsp;java：</p><pre><code class=\"language-java\">/*1~100的完数*/\nimport java.util.Scanner;\n\npublic class Perfect_Number {\n    public static void main(String[] args) {\n        System.out.println(\"完数：\");\n        System.out.print(\"\"\"\n                输入0为判断完数\n                输入1为列出1~10000完数\n                :\n                \"\"\");\n        Scanner sc = new Scanner(System.in);\n        int a = sc.nextInt();\n\n        if (a == 0) {\n            Perfect_number_1();//调用判断函数\n        } else if (a == 1) {\n            Perfect_number_2();//调用循环函数\n        }\n    }\n\n    //判断函数\n    public static void Perfect_number_1() {\n        System.out.println(\"输入一个数\");\n        Scanner sc = new Scanner(System.in);\n        int num = sc.nextInt();\n        int sum = 0;\n\n        /*\n         * 核心代码\n         * */\n        for (int i = 1; i &lt; num; i++) {\n            if (num % i == 0) {\n                sum = sum + i;\n            }\n        }\n\n        if (sum == num) {\n            System.out.println(\"是完数\");\n        } else {\n            System.out.println(\"不是完数\");\n        }\n    }\n    //循环函数\n    public static void Perfect_number_2() {\n        for (int j = 1; j &lt;= 10000; j++) {\n            int sum = 0;\n            for (int i = 1; i &lt; j; i++) {\n                if (j % i == 0) {\n                    sum = sum + i;\n                }\n            }\n\n            if (sum == j) {\n                System.out.println();\n                System.out.print(sum);\n            }\n        }\n    }\n}</code></pre><p><br></p>', '二、完数\n 概念：\n完全数（Perfect number），又称完美数或完备数，是一些特殊的自然数。它所有的真因子（即除了自身以外的约数）的和（即因子函数），恰好等于它本身。 例如： 6 的因子有：1 2 3 它们的和：1 + 2 + 3 = 6 所以 6 为完数\n 示例：\n  java：\n/*1~100的完数*/\nimport java.util.Scanner;\n\npublic class Perfect_Number {\n    public static void main(String', '2025/05/11/ef2bf57f-de1b-4b6e-b670-b7ba805c0a38.webp', 1, 'qxfly', '2025-02-08 19:19:15', '2025-05-11 13:19:26', 14, 1, 1, '数据结构,算法,数据结构与算法', 3, '编程', 11);
INSERT INTO `article` VALUES (116, '基础算法：求质数', '<p><br></p><h1 style=\"text-align: start;\">三、质数</h1><h3 style=\"text-align: start;\"> 概念：</h3><blockquote style=\"text-align: start;\">质数又称素数。一个大于 1 的自然数，除了 1 和它自身外，不能被其他自然数整除的数叫做质数 例如： 5 只能被 1 5 整除 5 / 1 = 5； 5 / 5 = 1 更多：2 3 5 7 9</blockquote><h3 style=\"text-align: start;\"> 示例：</h3><p> &nbsp;java：</p><pre><code class=\"language-java\">/*2~100的质数*/\npublic class Prime_Number {\n    public static void main(String[] args) {\n        System.out.println(\"质数：\");\n        Prime_number(); //调用函数\n    }\n\n    public static void Prime_number() {\n        for (int i = 2; i &lt;= 100; i++) {\n            int flag = 1;\n\n            /*\n             * 核心语句，判断是否为质数\n             * 枚举从2 ~ N的每一个数\n             * 实际上不用枚举到N，只需要枚举到√N就行\n             * √N 推荐使用i &lt;= n / i\n             * */\n            for (int j = 2; j &lt;= i / j; j++) {\n                if (i % j == 0) {\n                    flag = 0;\n                    break;\n                }\n            }\n\n            if (flag == 1) {\n                System.out.print(i + \"\\t\");\n            }\n        }\n    }\n}\n</code></pre><p><br></p>', '\n三、质数\n 概念：\n质数又称素数。一个大于 1 的自然数，除了 1 和它自身外，不能被其他自然数整除的数叫做质数 例如： 5 只能被 1 5 整除 5 / 1 = 5； 5 / 5 = 1 更多：2 3 5 7 9\n 示例：\n  java：\n/*2~100的质数*/\npublic class Prime_Number {\n    public static void main(String[] args) {\n        System.out.println(\"质数：\");\n       ', '2025/02/05/4a2eee35-db1a-45bd-9d78-0802953a91b3.webp', 36, 'CrimsonComet', '2025-02-09 20:42:40', '2025-02-09 20:42:40', 5, 0, 0, 'Java,数据结构,数据结构与算法,算法', 3, '编程', 11);
INSERT INTO `article` VALUES (117, 'Linux基础命令', '<ol><li style=\"text-align: start;\">cd : 改变目录。</li><li style=\"text-align: start;\">cd . . 回退到上一个目录，直接cd进入默认目录</li><li style=\"text-align: start;\">pwd : 显示当前所在的目录路径。</li><li style=\"text-align: start;\">ls(ll): 都是列出当前目录中的所有文件，只不过ll(两个ll)列出的内容更为详细。</li><li style=\"text-align: start;\">touch : 新建一个文件 如 touch index.js 就会在当前目录下新建一个index.js文件。</li><li style=\"text-align: start;\">rm: 删除一个文件, rm index.js 就会把index.js文件删除。</li><li style=\"text-align: start;\">mkdir: 新建一个目录,就是新建一个文件夹。</li><li style=\"text-align: start;\">rm -r : 删除一个文件夹, rm -r src 删除src目录。<span style=\"background-color: rgb(225, 60, 57);\">rm -rf / 切勿在Linux中尝试！删除电脑中全部文件！</span></li><li style=\"text-align: start;\">mv 移动文件, mv index.html src index.html 是我们要移动的文件, src 是目标文件夹,当然, 这样写,必须保证文件和目标文件夹在同一目录下。</li><li style=\"text-align: start;\">reset 重新初始化终端/清屏。</li><li style=\"text-align: start;\">clear 清屏。</li><li style=\"text-align: start;\">history 查看命令历史。</li><li style=\"text-align: start;\">help 帮助。</li><li style=\"text-align: start;\">exit 退出。</li><li style=\"text-align: start;\">#表示注释</li></ol><p><br></p>', 'cd : 改变目录。\ncd . . 回退到上一个目录，直接cd进入默认目录\npwd : 显示当前所在的目录路径。\nls(ll): 都是列出当前目录中的所有文件，只不过ll(两个ll)列出的内容更为详细。\ntouch : 新建一个文件 如 touch index.js 就会在当前目录下新建一个index.js文件。\nrm: 删除一个文件, rm index.js 就会把index.js文件删除。\nmkdir: 新建一个目录,就是新建一个文件夹。\nrm -r : 删除一个文件夹, rm -r src', '2025/02/05/4d83e0f8-3b20-42e1-9c10-ac34f9181cbe.webp', 1, 'qxfly', '2025-02-10 10:27:25', '2025-02-10 10:27:25', 1, 0, 0, 'Linux,Ubuntu,Centos', 3, '编程', 11);
INSERT INTO `article` VALUES (118, '基础算法：水仙花数', '<h1 style=\"text-align: start;\">一、水仙花数</h1><h3 style=\"text-align: start;\"> 概念：</h3><blockquote style=\"text-align: start;\">水仙花数（Narcissistic number）也被称为超完全数字不变数、自恋数、自幂数、阿姆斯壮数或阿姆斯特朗数。 水仙花数是指一个 3 位数，它的各位上的数字的 3 次幂之和等于它本身。 例如： 1^3 + 5^3+ 3^3 = 153</blockquote><h3 style=\"text-align: start;\"> 示例：</h3><p> &nbsp;java：</p><pre><code class=\"language-java\">import java.util.Scanner;\n\npublic class Narcissistic_Number {\n    public static void main(String[] args) {\n        System.out.println(\"水仙花数：\");\n        System.out.print(\"\"\"\n                输入0为判断水仙花数\n                输入1为列出水仙花数\n                :\n                \"\"\");\n        Scanner sc = new Scanner(System.in);\n        int a = sc.nextInt();\n\n        if (a == 0) {\n            Narcissistic_number_1();//调用判断函数\n        } else if (a == 1) {\n            Narcissistic_number_2();//调用循环函数\n        }\n    }\n\n    //判断函数\n    public static void Narcissistic_number_1() {\n        System.out.println(\"输入一个数\");\n        Scanner sc = new Scanner(System.in);\n        int num = sc.nextInt();\n\n        //num1为个位,num2为十位,num3为百位\n        int num1, num2, num3;\n        num1 = num % 10;    //个位\n        num2 = num / 10 % 10;   // 十位\n        num3 = num / 100 % 10;  //百位\n        /*\n         * 以此类推\n         * num / 1000 % 10    //千位\n         * num / 10000 % 10    //万位\n         */\n\n        if (num == (num1 * num1 * num1) + (num2 * num2 * num2) + (num3 * num3 * num3)) {\n            System.out.println(\"是水仙花数\");\n        } else {\n            System.out.println(\"不是水仙花数\");\n        }\n    }\n    //循环函数\n    public static void Narcissistic_number_2() {\n        System.out.println();\n        for (int num = 100; num &lt;= 999; num++) {\n            int num1, num2, num3;\n            num1 = num % 10;\n            num2 = num / 10 % 10;\n            num3 = num / 100 % 10;\n\n            if (num == (num1 * num1 * num1) + (num2 * num2 * num2) + (num3 * num3 * num3)) {\n                System.out.println(num);\n            }\n        }\n    }\n}</code></pre><p><br></p>', '一、水仙花数\n 概念：\n水仙花数（Narcissistic number）也被称为超完全数字不变数、自恋数、自幂数、阿姆斯壮数或阿姆斯特朗数。 水仙花数是指一个 3 位数，它的各位上的数字的 3 次幂之和等于它本身。 例如： 1^3 + 5^3+ 3^3 = 153\n 示例：\n  java：\nimport java.util.Scanner;\n\npublic class Narcissistic_Number {\n    public static void main(String[] args', '2025/05/11/3f4041e8-e84b-4c0b-9359-20f97d4b93e8.webp', 1, 'qxfly', '2025-02-11 10:31:15', '2025-05-11 13:19:10', 3, 1, 1, 'Java,算法,数据结构与算法,数据结构', 3, '编程', 11);
INSERT INTO `article` VALUES (121, '基础算法：九九乘法表', '<h3 style=\"text-align: start;\">概念：</h3><blockquote style=\"text-align: start;\">11=1 <br>12=2 22=4 <br>13=3 23=6 33=9 <br>14=4 24=8 34=12 44=16 <br>15=5 25=10 35=15 45=20 55=25 <br>16=6 26=12 36=18 46=24 56=30 66=36 <br>17=7 27=14 37=21 47=28 57=35 67=42 77=49<br>18=8 28=16 38=24 48=32 58=40 68=48 78=56 88=64 <br>19=9 29=18 39=27 49=36 59=45 69=54 79=63 89=72 9*9=81</blockquote><h3 style=\"text-align: start;\"> 示例：</h3><p> &nbsp;java：</p><pre><code class=\"language-java\">public class Multiplication_Table {\n    public static void main(String[] args) {\n        System.out.println(\"九九乘法表：\" + \"\\n\");\n        Multiplication_table(); //调用函数\n    }\n\n    public static void Multiplication_table() {\n        for (int i = 1; i &lt;= 9; i++) {\n            for (int j = 1; j &lt;= i; j++) {\n                System.out.print(j + \"*\" + i + \"=\" + i * j + \"\\t\");\n            }\n            System.out.println();\n        }\n\n    }\n}</code></pre><p><br></p>', '概念：\n11=1 \n12=2 22=4 \n13=3 23=6 33=9 \n14=4 24=8 34=12 44=16 \n15=5 25=10 35=15 45=20 55=25 \n16=6 26=12 36=18 46=24 56=30 66=36 \n17=7 27=14 37=21 47=28 57=35 67=42 77=49\n18=8 28=16 38=24 48=32 58=40 68=48 78=56 88=64 \n19=9 29=18 39=27 49=36 59=45 69=54 ', '2025/02/05/7f4fd5b4-8eab-4544-afe9-06e81525278b.webp', 2, 'test', '2025-02-12 11:57:24', '2025-02-12 11:57:24', 0, 0, 0, 'Java,数据结构与算法,数据结构,算法', 3, '编程', 11);
INSERT INTO `article` VALUES (122, 'Linux：详解(yum的使用、vim编辑器命令集合以及gcc/g++编译器的使用）', '<p>​</p><h1> Linux 软件包管理器 yum</h1><h2>什么是软件包：</h2><blockquote>在<span style=\"color: rgb(225, 60, 57);\">Linux下安装软件</span>, 一个通常的办法是下载到程序的源代码, 并进行编译, 得到可执行程序. 但是这样太麻烦了, 于是有些人把一些常用的软件提前编译好, 做成软件包(可以理解成windows上的安装程序)放在一个服务器上, <span style=\"color: rgb(255, 77, 79);\">通过包管理器可以很方便的获取到这个编译好的软件包</span>, 直接进行安装. 软件包和软件包管理器, 就好比 \"App\" 和 \"应用商店\" 这样的关系. yum(Yellow dog Updater, Modified)是Linux下非常常用的一种包管理器. 主要应用在Fedora, RedHat,Centos等发行版上</blockquote><h3>总结： </h3><blockquote>Linux中进行工具、指令。程序、安装、检查、卸载等需要yum软件。 安装软件的方法： <br> &nbsp; <strong> 1.源代码安装(需要我们去找到源代码，自己编译，没问题后再导入)-----不建议 <br> &nbsp; &nbsp;2.rpm包直接安装(需要找源代码包，在VS下编译，没问题在导入)-----不建议 <br> &nbsp; &nbsp;3.yum(CentOs 7)、apt-get(Ubuntu)----非常简单上手<br>yum是我们Linux预装的一个指令，可以搜索。下载。安装对应的软件。</strong></blockquote><h2>关于rzsz：</h2><blockquote>这个工具用于 windows 机器和远端的 Linux 机器通过 XShell 传输文件. 安装完毕之后可以通过拖拽的方式将文件上传过去。</blockquote><h3>注意事项：</h3><blockquote>关于 yum 的所有操作必须保证主机(虚拟机)网络畅通!!! 可以通过 ping 指令验证</blockquote><h3>实现： </h3><p><strong>首先需要导入软件包：yum install -y lrzsz</strong></p><p><strong>如果无法安装就需要一个扩展包(yum install -y epel-release),后再导入lrzsz。</strong></p><p><strong>将文件传到Linux上(或者直接鼠标进行拖入)：</strong></p><p><strong>将文件传到Windows上：</strong></p><h2>查看软件包：</h2><blockquote>通过 yum list 命令可以罗列出当前一共有哪些软件包. 由于包的数目可能非常之多, 这里我们需要使用 grep 命令只筛选出我们关注的包. 例如: yum list | grep sl 得到结果：sl.x86_64 0.12.20-36.el7 @base</blockquote><h3>注意事项：</h3><blockquote>软件包名称: 主版本号.次版本号.源程序发行号-软件包的发行号.主机平台.cpu架构. \"x86_64\" 后缀表示64位系统的安装包, \"i686\" 后缀表示32位系统安装包. 选择包时要和系统匹配. \"el7\" 表示操作系统发行版的版本. \"el7\" 表示的是 centos7/redhat7. \"el6\" 表示 centos6/redhat6. 最后一列, base 表示的是 \"软件源\" 的名称, 类似于 \"小米应用商店\", \"华为应用商店\" 这样的概念.</blockquote><h2>如何安装软件：</h2><blockquote>通过 yum, 我们可以通过很简单的一条命令完成 gcc 的安装. 例如：root用户下：yum install sl 其他用户(使用dudo需要在白名单)：sudo yum install lrzsz</blockquote><h3>注意事项：</h3><blockquote>安装软件时由于需要向系统目录中写入内容, 一般需要 sudo 或者切到 root 账户下才能完成. yum安装软件只能一个装完了再装另一个. 正在yum安装一个软件的过程中, 如果再尝试用yum安装另外一个软件, yum会报错.</blockquote><h2>如何卸载软件：</h2><blockquote>root用户： yum remove lrzsz 其他用户(使用dudo需要在白名单)：sudo yum remove lrzsz</blockquote><h2>yum的生态 ：</h2><blockquote>通过上面的了解我们知道怎么去查看，下载，删除一个软件。 1.那么yum是如何得知目标服务器的地址和下载链接的呢？ 答：yum源(.repo的都是yum源)。其中CentOS-Base.repo里面就包含了这些信息。 ​编辑 2.云服务器是谁提供的？ 答：国内各种组织，对应社区参与者或组织，利益相关者，它们会把国外Cent OS仓库镜像到国内。 3.是谁提供软件？ 答：全球的Cent OS社区，各自社区的人或者Linux的参与者。 4.它们为什么提供？ 答：第一类：使用这个OS，享受到了OS带来的便捷，就有技术动力，将对应的社区维护好；第二类：写软件的人有使命感(为爱发电)。</blockquote><h3>扩展： </h3><blockquote>我们在上面安装的扩展包：yum install -y epel-release，是为了找到更多的软件，因为基础软件源(CenOS-Base.repo)为了保持稳定性就一般不会进行频繁的添加软件，所以就有扩展软件源(epel.repo)。</blockquote><h1>Linux开发工具</h1><h2>vim的基本概念：</h2><blockquote>目前掌握这3种即可：分别是命令模式（command mode）、插入模式（Insert mode）和底行模式（last line mode），各模式的功能区分如下： 正常/普通/命令模式(Normal mode) 控制屏幕光标的移动，字符、字或行的删除，移动复制某区段及进入Insert mode下，或者到 last line mode 插入模式(Insert mode) 只有在Insert mode下，才可以做文字输入，按「ESC」键可回到命令行模式。该模式是我们后面用的最频繁 的编辑模式。 底行模式(last line mode) 文件保存或退出，也可以进行文件替换，找字符串，列出行号等操作。 在命令模式下，shift+: 即可进入该模式。要查看你的所有模式： 打开vim，底行模式直接输入：help vim-modes (一共有12种模式)</blockquote><h2>vim的基本操作：</h2><blockquote>进入vim,在系统提示符号输入vim及文件名称后，就进入vim全屏幕编辑画面: $ vim test.c 不过有一点要特别注意，就是你进入vim之后，是处于[命令模式]，你要切换到[插入模式]才能够输入文字。 [命令模式]切换至[插入模式] 输入a 输入i 输入o [插入模式]切换至[命令模式] 目前处于[插入模式]，就只能一直输入文字，如果发现输错了字,想用光标键往回移动，将该字删除，可以先按一下「ESC」键转到[正常模式]再删除文字。当然，也可以直接删除。 [命令模式]切换至[底行模式] 「shift + ;」, 其实就是输入「:」 退出vim及保存文件,在[命令模式]下，按一下「:」冒号键进入「底行模式」, 例如: : w （保存当前文件） : wq (输入「wq」,存盘并退出vim) : q! (输入q)</blockquote><h2>vim命令模式命令集：</h2><h3>常用的模式切换：</h3><h3>插入模式：</h3><blockquote>按「i」切换进入插入模式「insert mode」，按“i”进入插入模式后是从光标当前位置开始输入文件； 按「a」进入插入模式后，是从目前光标所在位置的下一个位置开始输入文字； 按「o」进入插入模式后，是插入新的一行，从行首开始输入文字。</blockquote><h3>从插入模式切换到命令模式：</h3><blockquote>按「ESC」键。</blockquote><h3>移动光标：</h3><p>在了解操作前，我们<strong>先了解一下曾经的键盘：</strong></p><p><br></p><blockquote>vim可以直接用键盘上的光标来上下左右移动，但正规的vim是用小写英文字母「h」、「j」、「k」、「l」，分别控制光标左、下、上、右移一格 按「G」：移动到文章的最后 按「 $ 」：移动到光标所在行的“行尾” 按「^」：移动到光标所在行的“行首” 按「w」：光标跳到下个单词的开头 按「e」：光标跳到下个单词的字尾 按「b」：光标回到上个单词的开头 按「#l」：光标移到该行的第#个位置，如：5l,56l 按［gg］：进入到文本开始 按［shift＋g］：进入文本末端 按「ctrl」+「b」：屏幕往“后”移动一页 按「ctrl」+「f」：屏幕往“前”移动一页 按「ctrl」+「u」：屏幕往“后”移动半页 按「ctrl」+「d」：屏幕往“前”移动半页</blockquote><h3>删除文字：</h3><blockquote>「x」：每按一次，删除光标所在位置的一个字符 「#x」：例如，「6x」表示删除光标所在位置的“后面（包含自己在内）”6个字符 「X」：大写的X，每按一次，删除光标所在位置的“前面”一个字符 「#X」：例如，「20X」表示删除光标所在位置的“前面”20个字符 「dd」：删除光标所在行 「#dd」：从光标所在行开始删除#行</blockquote><h3>复制：</h3><blockquote>「yw」：将光标所在之处到字尾的字符复制到缓冲区中。 「#yw」：复制#个字到缓冲区 「yy」：复制光标所在行到缓冲区。 「#yy」：例如，「6yy」表示拷贝从光标所在的该行“往下数”6行文字。 「p」：将缓冲区内的字符贴到光标所在位置。注意：所有与“y”有关的复制命令都必须与“p”配合才能完成复制与粘贴功能。</blockquote><h3>替换：</h3><blockquote>「r」：替换光标所在处的字符。 「R」：替换光标所到之处的字符，直到按下「ESC」键为止。</blockquote><h3>撤销上一次操作：</h3><blockquote>「u」：如果您误执行一个命令，可以马上按下「u」，回到上一个操作。按多次“u”可以执行多次回 复。 「ctrl + r」: 撤销的恢复</blockquote><h3>更改：</h3><blockquote>「cw」：更改光标所在处的字到字尾处 「c#w」：例如，「c3w」表示更改3个字</blockquote><h3>跳到指定行：</h3><blockquote>「ctrl」+「g」列出光标所在行的行号。 「#G」：例如，「15G」，表示移动光标至文章的第15行行首</blockquote><h2>vim底行模式：</h2><blockquote>在使用末行模式之前，请记住先按「ESC」键确定您已经处于正常模式，再按「：」冒号即可进入末行模式。 列出行号： 「set nu」: 输入「set nu」后，会在文件中的每一行前面列出行号。 跳到文件中的某一行： 「#」:「#」号表示一个数字，在冒号后输入一个数字，再按回车键就会跳到该行了，如输入数字15，再回车，就会跳到文章的第15行。 查找字符： 「/关键字」: 先按「/」键，再输入您想寻找的字符，如果第一次找的关键字不是您想要的，可以一直按「n」会往后寻找到您要的关键字为止。 「?关键字」：先按「?」键，再输入您想寻找的字符，如果第一次找的关键字不是您想要的，可以一直按「n」会往前寻找到您要的关键字为止。 问题：／ 和 ？查找有和区别？操作实验一下 答：\'\' / ”是从前往后，\" ? \"是从后往前。 保存文件： 「w」: 在冒号输入字母「w」就可以将文件保存起来 离开vim： 「q」：按「q」就是退出，如果无法离开vim，可以在「q」后跟一个「!」强制离开vim。 「wq」：一般建议离开时，搭配「w」一起使用，这样在退出的时候还可以保存文件。</blockquote><h2>扩展： </h2><blockquote>在命令模式： shift + zz：也能实现保存并退出 注释：ctrl+v，再hjkl或上下左右进行选择，然后shift+i，输入注释符: //,最后退出Esc即可完成注释； 取消注释： ctrl+v，再hjkl或上下左右进行选择，最后按下：d，即可完成取消注释 在底行模式： 显示行号：set nu； 取消行号：set nonu； 配置在vim界面里使用鼠标： 首先在终端下输入：vim ~/.vimrc ​编辑 然后在vim的插入模式下输入：set mouse=a ​编辑 然后在底行保持并退出输入：wq 最后在终端执行：source ~/.vimrc ​编辑 此时再使用vim就可以使用鼠标了！</blockquote><h2>vim操作总结：</h2><blockquote>主要的三种模式： 命令/正常模式； 插入模式； 底行模式； vim操作： 打开，关闭，查看，查询，插入，删除，替换，撤销，复制等等操作。</blockquote><h1><strong>Linux编译器-gcc/g++使用</strong></h1><h2>背景知识:</h2><blockquote>1. 预处理（进行宏替换) 2. 编译（生成汇编) 3. 汇编（生成机器可识别代码） 4. 连接（生成可执行文件或库文件) 5. 语言和编译器的自举过程： ​编辑</blockquote><h2>gcc如何完成：</h2><blockquote>格式： gcc [选项] 要编译的文件 [选项] [目标文件]</blockquote><h3><span style=\"color: rgb(254, 44, 36);\">预处理 ：</span></h3><blockquote>预处理：gcc -E test.c -o test.i（从开始进行程序的翻译过程，当预处理做完的时候，就停下来！） ​编辑 预处理指令是以#号开头的代码行。 选项“-E”,该选项的作用是让 gcc 在预处理结束后停止编译过程。 选项“-o”是指目标文件,“.i”文件为已经过预处理的C原始程序 头文件展开：将&lt;stdio.h&gt;库里的函数等已经定义好的东西，从投建内容拷贝至源文件； · 去注释：将注释的代码段进行剔除； 宏替换：将宏定义的内容进行替换； 条件编译：如：防止头文件的重复包含，导致的多次展开(通过给编译器传递不同的宏值，来进行对代码的动态裁剪！！！)； 此时的到的还是C语言写的文本！！！ 这里的-D：指定义一个宏 ​编辑</blockquote><h3><span style=\"color: rgb(254, 44, 36);\">编译(C语言-&gt;汇编)：</span></h3><blockquote>编译：gcc -S test.i -o test.s（从开始进行程序的翻译过程，当编译做完的时候，就停下来！） ​编辑 在这个阶段中,gcc 首先要检查代码的规范性、是否有语法错误等,以确定代码的实际要做的工作,在检查无误后,gcc 把代码翻译成汇编语言。 用户可以使用“-S”选项来进行查看,该选项只进行编译而不进行汇编,生成汇编代码。</blockquote><h3><span style=\"color: rgb(254, 44, 36);\">汇编( 汇编-&gt;二进制(可重定位目标二进制文件[是不能执行的])):</span></h3><blockquote>汇编：gcc -c test.s -o test.o（从开始进行程序的翻译过程，当汇编做完的时候，就停下来！） ​编辑 汇编阶段是把编译阶段生成的“.s”文件转成目标文件 读者在此可使用选项“-c”就可看到汇编代码已转化为“.o”的二进制目标代码了。</blockquote><h3><span style=\"color: rgb(254, 44, 36);\">链接(生成可执行文件或库文件)：</span></h3><blockquote>链接：gcc -o test test.o ​编辑 在成功编译之后,就进入了链接阶段.</blockquote><h3>函数库：</h3><blockquote>我们的C程序中，并没有定义“printf”的函数实现,且在预编译中包含的“stdio.h”中也只有该函数的声明,而没有定义函数的实现,那么,是在哪里实“printf”函数的呢? 最后的答案是:系统把这些函数实现都被做到名为 libc.so.6 的库文件中去了,在没有特别指定时,gcc 会到系统默认的搜索路径“/usr/lib”下进行查找,也就是链接到 libc.so.6 库函数中去,这样就能实现函数“printf”了,而这也就是链接的作用。</blockquote><p><strong>查看文件的依赖库：ldd test.exe(编译过的文件) </strong></p><p>​编辑</p><p><strong>结论：一个平台要支持开发，就必须要提前在系统中安装该语言的标准头文件+库文件！！！</strong></p><h4><span style=\"color: rgb(254, 44, 36);\">静态库(静态链接)： </span></h4><blockquote>静态库是指编译链接时,把库文件的代码全部加入到可执行文件中,因此生成的文件比较大,但在运行时也就不再需要库文件了。其后缀名一般为“.a” 理解：将自己所需的代码拷贝到自己的可执行程序中。 优点：不依赖库，在相同类型的平台都可以总结运行使用。 缺点：可执行程序体积比较大，比较浪费资源(磁盘、内存、网路等)。</blockquote><h4><span style=\"color: rgb(254, 44, 36);\">动态库(动态链接)：</span></h4><blockquote>动态库与之相反,在编译链接时并没有把库文件的代码加入到可执行文件中,而是在程序执行时由运行时链接文件加载库,这样可以节省系统的开销。动态库一般后缀名为“.so”,如前面所述的 libc.so.6 就是动态库。gcc 在编译时默认使用动态库。完成了链接之后,gcc 就可以生成可执行文件,如下所示。 gcc test.o -o test.exe gcc默认生成的二进制程序，是动态链接的，这点可以通过 file 命令验证。 理解：通过地址去访问动态库，可以被多个使用者共享使用，一旦缺失，所有的程序都不能运行了! 优点：比较节省资源(磁盘、内存、网路等)，不会出现太多的重复代码。 缺点：对库的依赖性比较强，一旦库丢失，所有使用这个库的程序都无法运行！</blockquote><p>​编辑</p><h4>补充知识： </h4><blockquote>我们应该怎么用动态库和静态库呢？ 答：我们默认的gcc/g++编译一个文件，默认使用的就是动态链接，如果我们想使用静态链接，首先就需要调入静态库的包：yum install -y glibc-static ,然后编译。可以看到静态链接的文件大小单单几个printf就已经是动态链接的100倍了，明显体现了静态链接对资源的消耗。 ​编辑</blockquote><h3>gcc选项：</h3><blockquote>-E 只激活预处理,这个不生成文件,你需要把它重定向到一个输出文件里面 -S 编译到汇编语言不进行汇编和链接 -c 编译到目标代码 -o 文件输出到 文件 -static 此选项对生成的文件采用静态链接 -g 生成调试信息。GNU 调试器可利用该信息。 -shared 此选项将尽量使用动态库，所以生成文件比较小，但是需要系统由动态库. -O0，-O1，-O2，-O3 编译器的优化选项的4个级别，-O0表示没有优化,-O1为缺省值，-O3优化级别最高 -w 不生成任何警告信息。 -Wall 生成所有警告信息。</blockquote><h1>Linux项目自动化构建工具-make/Makefile</h1><h2>背景：</h2><blockquote>会不会写makefile，从一个侧面说明了一个人是否具备完成大型工程的能力 一个工程中的源文件不计数，其按类型、功能、模块分别放在若干个目录中，makefile定义了一系列的规则来指定，哪些文件需要先编译，哪些文件需要后编译，哪些文件需要重新编译，甚至于进行更复杂的功能操作 makefile带来的好处就是——“自动化编译”，一旦写好，只需要一个make命令，整个工程完全自动编译，极大的提高了软件开发的效率。 make是一个命令工具，是一个解释makefile中指令的命令工具，一般来说，大多数的IDE都有这个命令，比如：Delphi的make，Visual C++的nmake，Linux下GNU的make。可见，makefile都成为了一种在工程方面的编译方法。 make是一条命令，makefile是一个文件，两个搭配使用，完成项目自动化构建。</blockquote><h2>原理：</h2><blockquote>make是如何工作的,在默认的方式下，也就是我们只输入make命令。那么， 1. make会在当前目录下找名字叫“Makefile”或“makefile”的文件。 2. 如果找到，它会找文件中的第一个目标文件（target），在上面的例子中，他会找到“hello”这个文件，并把这个文件作为最终的目标文件。 3. 如果hello文件不存在，或是hello所依赖的后面的hello.o文件的文件修改时间要比hello这个文件新（可以用 touch 测试），那么，他就会执行后面所定义的命令来生成hello这个文件。 4. 如果hello所依赖的hello.o文件不存在，那么make会在当前文件中找目标为hello.o文件的依赖性，如果找到则再根据那一个规则生成hello.o文件。（这有点像一个堆栈的过程） 5. 当然，你的C文件和H文件是存在的，于是make会生成 hello.o 文件，然后再用 hello.o 文件声明make的终极任务，也就是执行文件hello了。 6. 这就是整个make的依赖性，make会一层又一层地去找文件的依赖关系，直到最终编译出第一个目标文件。 7. 在找寻的过程中，如果出现错误，比如最后被依赖的文件找不到，那么make就会直接退出，并报错，而对于所定义的命令的错误，或是编译不成功，make根本不理。 8. make只管文件的依赖性，即，如果在我找了依赖关系之后，冒号后面的文件还是不在，那么对不起，我就不工作啦。</blockquote><h2>项目清理(clean)：</h2><blockquote>工程是需要被清理的 像clean这种，没有被第一个目标文件直接或间接关联，那么它后面所定义的命令将不会被自动执行，不过，我们可以显示要make执行。即命令——“make clean”，以此来清除所有的目标文件，以便重编译。 但是一般我们这种clean的目标文件，我们将它设置为伪目标,用 .PHONY 修饰,伪目标的特性是，总是被执行的。</blockquote><h2>使用： </h2><blockquote>首先需要创建一个makefile文件，在里面输入以下内容：​编辑 这样我们在终端输入make就会进行编译，如果输入make clean就会执行将test.i test.s test.o mytest删除，为什么要删除呢？因为make的执行根文件的内容的更改时间和已经生成的可执行文件的时间来对比，如果可执行文件是在文件修改时间后创建的就不会再执行编译工作！！！​编辑 所以就需要我们先删除以生成的可执行文件！​编辑</blockquote><h2>依赖关系和依赖方法： </h2><blockquote>在上面的使用中：mytest：test.c是依赖关系； gcc -o mytest test.c 是依赖方法。</blockquote><h2>makefile的扩展补充：</h2><blockquote>1.伪目标(.PHONY:)： 修饰mytest目标文件，让目标文件称为一个伪目标：这个目标文件总被执行 ，就不会因为文件内容没有改变而不执行！(即：跳过时间的对比) ​编辑 2.$@ 和 $^ 以及3.定义变量： ​编辑 4.一个编译过程的依赖关系： ​编辑 这个过程中只要缺失一个都会导致依赖关系不全而导致后续的编译无法完成： ​编辑</blockquote><h2>总结：</h2><blockquote>1.makefile和make形成目标文件的时候，默认是从上到下扫描makefile文件的，默认形成的是第一个目标文件； 2.默认只形成一个，如：mytest:test.c 或 clean 形成其中一个； 3.在makefile中注释用‘ # ’； 4.一般建议clean写成伪目标(.PHONY：);​</blockquote>', '​\n Linux 软件包管理器 yum\n什么是软件包：\n在Linux下安装软件, 一个通常的办法是下载到程序的源代码, 并进行编译, 得到可执行程序. 但是这样太麻烦了, 于是有些人把一些常用的软件提前编译好, 做成软件包(可以理解成windows上的安装程序)放在一个服务器上, 通过包管理器可以很方便的获取到这个编译好的软件包, 直接进行安装. 软件包和软件包管理器, 就好比 \"App\" 和 \"应用商店\" 这样的关系. yum(Yellow dog Updater, Modified)是Lin', '2025/02/05/fd74c7eb-b8fb-4d6e-9311-f3322c9d2f03.webp', 32, '青柠衬酸', '2025-02-13 12:06:33', '2025-02-13 12:06:33', 2, 0, 0, 'C/C++', 3, '计算机', 11);
INSERT INTO `article` VALUES (123, '数据结构：一篇拿捏十大排序(超详细版)', '<p>​</p><h1> 排序的概念：</h1><blockquote>排序：所谓排序，就是使一串记录，按照其中的某个或某些关键字的大小，递增或递减的排列起来的操作。 稳定性：假定在待排序的记录序列中，存在多个具有相同的关键字的记录，若经过排序，这些记录的相对次序保持不变，即在原序列中，r[i]=r[j]，且r[i]在r[j]之前，而在排序后的序列中，r[i]仍在r[j]之前，则称这种排序算法是稳定的；否则称为不稳定的。 内部排序(内存中排序)：数据元素全部放在内存中的排序。 外部排序(磁盘中排序)：数据元素太多不能同时放在内存中，根据排序过程的要求不能在内外存之间移动数据的排序。 注意：此文的八种排序均是内部排序，而归并排序即可以说是内部排序，也可以说是外部排序。</blockquote><h1>插入排序：</h1><blockquote>基本思想：把待排序的记录按其关键码值的大小逐个插入到一个已经排好序的有序序列中，直到所有的记录插入完为止，得到一个新的有序序列 。例如：斗地主。</blockquote><h2>直接插入排序：</h2><blockquote>当插入第i(i&gt;=1)个元素时，前面的array[0],array[1],…,array[i-1]已经排好序，此时用array[i]的排序码与array[i-1],array[i-2],…的排序码顺序进行比较，找到插入位置即将array[i]插入，原来位置上的元素顺序后移。</blockquote><h3>直接插入排序实现：</h3><p><br></p><pre><code class=\"language-cpp hljs\">//直接插入排序\n//时间复杂度：O(n^2)  复杂度范围：O(n)-O(n^2)\nvoid InsertSort(int* a,int n)\n{\n	for (int i = 0; i &lt; n - 1; i++)\n	{\n		int end = i;\n		int tmp = a[end + 1];\n		while (end &gt;= 0)\n		{\n			if (a[end] &gt; tmp)\n			{\n				a[end + 1] = a[end];\n			}\n			else\n			{\n				break;\n			}\n			end--;\n		}\n		a[end + 1] = tmp;\n	}\n}</code></pre><blockquote>直接插入排序的特性总结： 1. 元素集合越接近有序，直接插入排序算法的时间效率越高 2. 时间复杂度：O(N^2) 3. 空间复杂度：O(1)，它是一种稳定的排序算法 4. 稳定性：稳定</blockquote><h2>希尔排序( 缩小增量排序 )：</h2><blockquote>希尔排序法又称缩小增量法。希尔排序法的基本思想是：先选定一个整数，把待排序文件中所有记录分成个组，所有距离为的记录分在同一组内，并对每一组内的记录进行排序。然后，重复上述分组和排序的工作。当到达=1时，所有记录在统一组内排好序。 预排序(gap&gt;1)：大的数更快的到后面去，小的数更快到前面，gap越大跳的越快，越不接近有序，gap越小跳的越慢，越接近有序，当gap=1时，完成排序。</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">//希尔排序\n//时间复杂度：O(nlogn)  复杂度范围：O(n^1.3)-O(nlogn)\nvoid ShellSort(int* a, int n)\n{\n	int gap = n;\n	while (gap &gt; 1)\n	{\n		//gap = gap / 2;\n		gap = gap / 3 + 1;\n		for (int i = 0; i &lt; n - gap; i++)\n		{\n			int end = i;\n			int tmp = a[i + gap];\n			while (end &gt;= 0)\n			{\n				if (a[end] &gt; tmp)\n				{\n					a[end + gap] = a[end];\n				}\n				else\n				{\n					break;\n				}\n				end -= gap;\n			}\n			a[gap + end] = tmp;\n		}\n	}\n}</code></pre><blockquote>希尔排序的特性总结： 1. 希尔排序是对直接插入排序的优化。 2. 当gap &gt; 1时都是预排序，目的是让数组更接近于有序。当gap == 1时，数组已经接近有序的了，这样就会很快。这样整体而言，可以达到优化的效果。我们实现后可以进行性能测试的对比。 3. 希尔排序的时间复杂度不好计算，因为gap的取值方法很多，导致很难去计算，因此在好些树中给出的希尔排序的时间复杂度都不固定： 《数据结构-用面相对象方法与C++描述》--- 殷人昆 ​编辑 因为咋们的gap是按照Knuth提出的方式取值的，而且Knuth进行了大量的试验统计，我们暂时就按照：O(n^1.25)到O(1.6^1.25)来算。 4. 稳定性：不稳定</blockquote><h1>选择排序：</h1><blockquote>基本思想：每一次从待排序的数据元素中选出最小（或最大）的一个元素，存放在序列的起始位置，直到全部待排序的数据元素排完 。</blockquote><h2>直接选择排序：</h2><blockquote>基本思想： 1.在元素集合array[i]--array[n-1]中选择关键码最大(小)的数据元素 2.若它不是这组元素中的最后一个(第一个)元素，则将它与这组元素中的最后一个（第一个）元素交换 3.在剩余的array[i]--array[n-2]（array[i+1]--array[n-1]）集合中，重复上述步骤，直到集合剩余1个元素</blockquote><p>​</p><pre><code class=\"language-cpp hljs\">//直接选择排序\n//时间复杂度：O(n^2)  复杂度范围：O(n^2)-O(n^2)\nvoid Swap(int* p1, int* p2)\n{\n	int tmp = *p1;\n	*p1 = *p2;\n	*p2 = tmp;\n}\n\nvoid SelectSort(int* a, int n)\n{\n	int end = n - 1;\n	int begin = 0;\n	while (end &gt; begin)\n	{\n		int maxi = begin;\n		int mini = begin;\n		for (int i = begin + 1; i &lt;= end ; i++)\n		{\n			if (a[maxi] &lt; a[i])\n			{\n				maxi = i;\n			}\n			if (a[mini] &gt; a[i])\n			{\n				mini = i;\n			}\n		}\n		Swap(&a[maxi], &a[end]);\n		if (mini == end)\n		{\n			mini = maxi;\n		}\n		Swap(&a[mini], &a[begin]);\n\n		end--;\n		begin++;\n	}\n}</code></pre><blockquote>直接选择排序的特性总结： 1. 直接选择排序思考非常好理解，但是效率不是很好。实际中很少使用 2. 时间复杂度：O(N^2) 3. 空间复杂度：O(1) 4. 稳定性：不稳定</blockquote><h2>堆排序：</h2><blockquote>堆排序(Heapsort)是指利用堆积树（堆）这种数据结构所设计的一种排序算法，它是选择排序的一种。它是通过堆来进行选择数据。需要注意的是排升序要建大堆，排降序建小堆。</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">//堆排序\n//时间复杂度：O(nlogn)  复杂度范围：O(nlogn)-O(nlogn)\n//向下调整（此时建立大堆）\nvoid Swap(int* p1, int* p2)\n{\n	int tmp = *p1;\n	*p1 = *p2;\n	*p2 = tmp;\n}\n\nvoid Adjustdown(int* a, int n, int parent)\n{\n	int child = (parent * 2) + 1;\n	while (child &lt; n)\n	{\n		if (child + 1 &lt; n && a[child] &lt; a[child + 1])\n		{\n			child++;\n		}\n		if (a[parent] &lt; a[child])\n		{\n			Swap(&a[child], &a[parent]);\n			parent = child;\n			child = (parent * 2) + 1;\n		}\n		else\n		{\n			break;\n		}\n	}\n}\n\nvoid HeapSort(int* a, int n)\n{\n	for (int i = (n - 1 - 1) / 2;i &gt; 0;i--)\n	{\n		Adjustdown(a, n, i);\n	}\n\n	int end = n;\n	while (end &gt; 0)\n	{\n		Swap(&a[0], &a[end - 1]);\n		Adjustdown(a, end - 1, 0);\n		end--;\n	}\n}</code></pre><blockquote>直接选择排序的特性总结： 1. 堆排序使用堆来选数，效率就高了很多。 2. 时间复杂度：O(N*logN) 3. 空间复杂度：O(1) 4. 稳定性：不稳定</blockquote><h1>交换排序：</h1><blockquote>基本思想：所谓交换，就是根据序列中两个记录键值的比较结果来对换这两个记录在序列中的位置，交换排序的特点是：将键值较大的记录向序列的尾部移动，键值较小的记录向序列的前部移动。</blockquote><h2>冒泡排序：</h2><blockquote>每趟将最大的数排序到范围内最后一个位置，每趟结束后减少一个范围数，第二趟将次大的数排序到倒数第二个位置，当一趟排序没有改变数组顺序，说明排序完成，直接退出循环，否则依次排序完整个数组。</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">//冒泡排序\n//时间复杂度：O(n^2)  复杂度范围：O(n)-O(n^2)\nvoid Swap(int* p1, int* p2)\n{\n	int tmp = *p1;\n	*p1 = *p2;\n	*p2 = tmp;\n}\n\nvoid BubblingSort(int* a, int n)\n{\n	for (int i = 0; i &lt; n; i++)\n	{\n		int change = 0;\n		for (int j = 1; j &lt; n - i; j++)\n		{\n			if (a[j - 1] &gt; a[j])\n			{\n				Swap(&a[j - 1], &a[j]);\n				change = 1;\n			}\n		}\n		if (change == 0)\n		{\n			break;\n		}\n	}\n}</code></pre><blockquote>冒泡排序的特性总结： 1. 冒泡排序是一种非常容易理解的排序 2. 时间复杂度：O(N^2) 3. 空间复杂度：O(1) 4. 稳定性：稳定</blockquote><h2>快速排序：</h2><blockquote>快速排序是Hoare于1962年提出的一种二叉树结构的交换排序方法，其基本思想为：任取待排序元素序列中的某元素作为基准值，按照该排序码将待排序集合分割成两子序列，左子序列中所有元素均小于基准值，右子序列中所有元素均大于基准值，然后最左右子序列重复该过程，直到所有元素都排列在相应位置上为止。</blockquote><h3>hoare版本：</h3><blockquote>右边节点从右向左，如果节点的值大于或大于基元素(a[right] &gt;= a[key])接着向左移动，否则到左边节点从左向右，如果节点的值小于或大于基元素(a[left] &lt;= a[key])接着向右移动，都停止后，交换当前节点值，循环结束后，再将基元素与左节点交换。然后分治递归解决排序问题。 注意(可能做的过程会遗漏问题)： 1.当前节点与基节点比较要取等于号，否则节点值和基节点值相同时，会死循环； 2.注意节点移动时考虑left &lt; right,否则可能发生数组越界；</blockquote><blockquote>问：相遇位置比key小，怎么做到的? 答：右边的先走的做到的。 相遇情况分析: 1、R动L不动，去跟L相遇了（相遇位置是L的位置，L和R在上一轮交换过，交换以后L位置的值比key要小） 2、L动R不动，去跟R相遇了（R先走，找大比key小的，停下来了，这时L找大没有找到跟R相遇了，相遇位置比key小）</blockquote><blockquote>快速排序优化： 1. 三数取中法选key 2. 递归到小的子区间时，可以考虑使用插入排序</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">//三数取中\nint Middle(int* a,int left, int right)\n{\n	int mid = (left + right) / 2;\n	if (a[left] &gt; a[right])\n	{\n		if (a[left] &gt; a[mid])\n		{\n			if (a[right] &gt; a[mid])\n			{\n				return right;\n			}\n			else\n			{\n				return mid;\n			}\n		}\n		else\n		{\n			return left;\n		}\n	}\n	else\n	{\n		if (a[right] &gt; a[mid])\n		{\n			if (a[left] &gt; a[mid])\n			{\n				return left;\n			}\n			else\n			{\n				return mid;\n			}\n		}\n		else\n		{\n			return right;\n		}\n	}\n}\n//hoare方法\nint Hoare(int* a, int left, int right)\n{\n	int mid = Middle(a,left, right);\n	Swap(&a[left], &a[mid]);\n\n	int key = left;\n	while (left &lt; right)\n	{\n		while (left &lt; right && a[right] &gt;= a[key])\n		{\n			right--;\n		}\n		while (left &lt; right && a[left] &lt;= a[key])\n		{\n			left++;\n		}\n		Swap(&a[left], &a[right]);\n	}\n	Swap(&a[key], &a[left]);\n	return left;\n}\n\nvoid QuickSort(int* a, int begin, int end)\n{\n	if (begin &gt;= end)\n	{\n		return;\n	}\n\n	int key = Hoare(a, begin, end);\n	QuickSort(a, begin, key - 1);\n	QuickSort(a, key + 1, end);\n}</code></pre><blockquote>快速排序的特性总结： 1. 快速排序整体的综合性能和使用场景都是比较好的，所以才敢叫快速排序 2. 时间复杂度：O(N*logN) 3. 空间复杂度：O(logN) 4. 稳定性：不稳定</blockquote><p><br></p>', '​\n 排序的概念：\n排序：所谓排序，就是使一串记录，按照其中的某个或某些关键字的大小，递增或递减的排列起来的操作。 稳定性：假定在待排序的记录序列中，存在多个具有相同的关键字的记录，若经过排序，这些记录的相对次序保持不变，即在原序列中，r[i]=r[j]，且r[i]在r[j]之前，而在排序后的序列中，r[i]仍在r[j]之前，则称这种排序算法是稳定的；否则称为不稳定的。 内部排序(内存中排序)：数据元素全部放在内存中的排序。 外部排序(磁盘中排序)：数据元素太多不能同时放在内存中，根据排序过程的', '2025/02/05/e2552c5f-305d-4e81-82da-8025bc78b247.webp', 32, '青柠衬酸', '2025-02-13 12:09:33', '2025-02-13 12:09:33', 2, 0, 0, '', 3, NULL, 11);
INSERT INTO `article` VALUES (124, 'C++：内存管理', '<h1>内存分布：</h1><p><strong>首先我们需要了解的是C/C++中内存区域的划分：</strong></p><blockquote>1. 栈又叫堆栈--非静态局部变量/函数参数/返回值等等，栈是向下增长的：先调用的地址比后调用的地址大。 2. 内存映射段是高效的I/O映射方式，用于装载一个共享的动态内存库。用户可使用系统接口 创建共享共享内存，做进程间通信。 3. 堆用于程序运行时动态内存分配，堆是可以上增长的：先调用的地址比后调用的地址小。 4. 数据段--存储全局数据和静态数据。 5. 代码段--可执行的代码/只读常量。</blockquote><h2>当我们懂了内存分布，可以尝试练习：</h2><p>是不是前面还算简单，下面就写懵圈了！</p><blockquote>解析： char2是定义在栈上的，它将在常量区的“abcd”拷贝的一份到数组中，，所以解引用(数组名是数组的首地址)还是是在栈上； pChar3是一个指向常量区的“abcd”的一个指针，定义在栈上，解引用后就是常量区的“abcd”所以解引用在常量区； ptr1定义在栈上，但是malloc开辟的空间在堆上，所以解引用是在堆上；</blockquote><h2>栈和堆的区别： </h2><blockquote>栈和堆的区别： 栈：由编译器自动分配并且出了作用域就释放，一般存储函数的参数局部变量等。 堆：由我们通过开辟的空间分配，需要我们手动释放，若程不释放则系统释放。 1、申请内存的方式: 栈：由编译器自动分配，如变量的声明的同时会开辟空间。 堆：由程序员申请，需要制定需要的大小（动态分配）。 2、系统响应的不同: 栈：只要系统剩余空间大于申请内存，系统就会提供，否则程序会崩溃流：栈溢出。 堆：遍历空闲地址链表，找到符合要求的，就将该地址分配给程序，内存的首地址记录分配的大小（方便delete）。 3、空间大小不同: 栈：连续的，编译时就确定的大小； 堆：不连续，他的上限决定于系统中有效的虚拟内存。 4、执行效率的不同: 栈：由系统分配，速度快； 堆：程序员分配，速度慢，容易产生内存碎片，需要多少开辟多少。</blockquote><h1>C语言中动态内存管理方式：malloc/calloc/realloc/free</h1><blockquote>malloc/calloc/realloc的区别： 1.malloc和realloc分配好内存空间后不会对空间初始化，calloc会对空间全部初始化为0. 2.参数不同：malloc(需要开辟的大小)、calloc(需要开辟个数，每个的大小)、realloc(原来的指针，新的内存块大小)。 3.它们空间分配失败的返回值地址都为NULL； 4.它们都需要free释放内存，否则会造成内存泄漏等问题。</blockquote><h1>C++内存管理方式</h1><blockquote>C语言内存管理方式在C++中可以继续使用，但有些地方就无能为力，而且使用起来比较麻烦，因此C++又提出了自己的内存管理方式：通过new和delete操作符进行动态内存管理。</blockquote><h2>new/delete操作内置类型</h2><blockquote>注意：在申请自定义类型的空间时，new会调用构造函数，delete会调用析构函数，而malloc与free不会。</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">#include &lt;iostream&gt;\nusing namespace std;\n\nclass Stack\n{\npublic:\n	Stack(int capacity = 4)\n	{\n		cout &lt;&lt; \"构造函数\" &lt;&lt; endl;\n\n		_capacity = capacity;\n		_a = new int[_capacity];\n		_top = 0;\n	}\n\n	~Stack()\n	{\n		cout &lt;&lt; \"析构函数\" &lt;&lt; endl;\n\n		delete[] _a;\n		_a = nullptr;\n		_top = 0;\n		_capacity = 0;\n	}\nprivate:\n	int* _a;\n	int _capacity;\n	int _top;\n};\n\nint main()\n{\n	Stack s1;\n\n	//Stack* p1 = new Stack;//1.new先开辟一个Stack大小的空间；2.然后调用构造函数在开辟一个栈的空间\n	//delete p1;//1.先释放构造函数开辟的空间；2.再释放new开辟的Stack的空间\n\n	//Stack* p2 = (Stack*)operator new(sizeof(Stack));//没有去调用构造函数初始化\n	//operator delete(p2);//没有去调用析构函数，导致内存泄漏：给栈开辟的空间没有释放\n\n	//Stack* p3 = new Stack[10];//这里开辟的空间会多开4个，用于存放开辟的数量，便于delete使用\n	////delete[] p3;\n	//delete p3;//空间不能局部释放：直接去释放Stack的空间，前面还有用于记录数量的空间，所以程序崩溃\n\n\n	return 0;\n}</code></pre><h2>操作自定义类型：</h2><blockquote>new/delete 和 malloc/free最大区别是 new/delete对于【自定义类型】除了开空间还会调用构造函数和析构函数！！！</blockquote><p><br></p><pre><code class=\"language-cpp hljs\">class A\n{\npublic:\n	A(int a = 0)\n		: _a(a)\n	{\n		cout &lt;&lt; \"A():\" &lt;&lt; this &lt;&lt; endl;\n	}\n\n	//~A()\n	//{\n	//	cout &lt;&lt; \"~A():\" &lt;&lt; this &lt;&lt; endl;\n	//}\n\nprivate:\n	int _a;\n};\n\nint main()\n{\n	A* p4 = new A[10];\n	//delete p4;//如果没有定义析构是不会出错：因为编译器的优化认为不需要调用析构，所以没有多开辟空间来记录开辟的个数\n	free(p4);//同理\n\n	return 0;\n}\n//通过上面两个程序的比较：new/delete  new[]/delete[] malloc/free 一定要配对使用，否则结果是未定义\n</code></pre><blockquote>注意： 申请和释放单个元素的空间，使用new和delete操作符，申请和释放连续的空间，使用 new[]和delete[]，注意：new和delete匹配起来使用。</blockquote><h1>了解operator new与operator delete函数</h1><blockquote>new和delete是用户进行动态内存申请和释放的操作符，operator new 和operator delete是系统提供的全局函数，new在底层调用operator new全局函数来申请空间，delete在底层通过operator delete全局函数来释放空间。</blockquote><blockquote>void* __CRTDECL operator new(size_t size) _THROW1(_STD bad_alloc) { // try to allocate size bytes void* p; while ((p = malloc(size)) == 0) if (_callnewh(size) == 0) { // report no memory // 如果申请内存失败了，这里会抛出bad_alloc 类型异常 static const std::bad_alloc nomem; _RAISE(nomem); } return (p); } 可以看到operator new 函数实际还是通过malloc来申请空间，当malloc申请空间成功时直接返回；申请空间失败，尝试执行空间不足应对措施，如果改应对措施用户设置了，则继续申请，否则抛异常。可以理解为：为了解决C语言中将malloc失败的NULL设置为0，导致一些特殊场景的错误，所以将malloc进行封装了,对malloc失败进行异常抛出。</blockquote><blockquote>void operator delete(void* pUserData) { _CrtMemBlockHeader* pHead; RTCCALLBACK(_RTC_Free_hook, (pUserData, 0)); if (pUserData == NULL) return; _mlock(_HEAP_LOCK); /* block other threads */ __TRY /* get a pointer to memory block header */ pHead = pHdr(pUserData); /* verify block type */ _ASSERTE(_BLOCK_TYPE_IS_VALID(pHead-&gt;nBlockUse)); _free_dbg(pUserData, pHead-&gt;nBlockUse); __FINALLY _munlock(_HEAP_LOCK); /* release other threads */ __END_TRY_FINALLY return; } operator delete函数本质还是通过free来释放空间，</blockquote><blockquote>通过上述两个全局函数的实现知道，operator new 实际也是通过malloc来申请空间，如果malloc申请空间成功就直接返回，否则执行用户提供的空间不足应对措施，如果用户提供该措施就继续申请，否则就抛异常。operator delete 最终是通过free来释放空间的。</blockquote><h1>new和delete的实现原理</h1><h2>内置类型：</h2><blockquote>如果申请的是内置类型的空间，new和malloc，delete和free基本类似，不同的地方是： new/delete申请和释放的是单个元素的空间，new[]和delete[]申请的是连续空间，而且new在申请空间失败时会抛异常，malloc会返回NULL。</blockquote><h2>自定义类型：</h2><blockquote>new的原理： 1. 调用operator new函数申请空间 2. 在申请的空间上执行构造函数，完成对象的构造 delete的原理： 1. 在空间上执行析构函数，完成对象中资源的清理工作 2. 调用operator delete函数释放对象的空间 new T[N]的原理： 1. 调用operator new[]函数，在operator new[]中实际调用operator new函数完成N个对象空间的申请： 2. 在申请的空间上执行N次构造函数 delete[]的原理： 1. 在释放的对象空间上执行N次析构函数，完成N个对象中资源的清理 2. 调用operator delete[]释放空间，实际在operator delete[]中调用operator delete来释放空间</blockquote><h1>定位new表达式(placement-new)</h1><blockquote>定位new表达式是在已分配的原始内存空间中调用构造函数初始化一个对象。 使用格式： new (place_address) type或者new (place_address) type(initializer-list) place_address必须是一个指针，initializer-list是类型的初始化列表 使用场景： 定位new表达式在实际中一般是配合内存池使用。因为内存池分配出的内存没有初始化，所以如果是自定义类型的对象，需要使用new的定义表达式进行显示调构造函数进行初始化</blockquote><h1>特别需要理解：malloc/free和new/delete的区别</h1><blockquote>malloc/free和new/delete:共同点是：都是从堆上申请空间，并且需要用户手动释放。不同的地方是： <br> &nbsp; &nbsp;1. malloc和free是函数，new和delete是操作符; <br> &nbsp; &nbsp;2. malloc申请的空间不会初始化，new可以初始化; <br> &nbsp; &nbsp;3. malloc申请空间时，需要手动计算空间大小并传递，new只需在其后跟上空间的类型即可，如果是多个对象，[]中指定对象个数即可; <br> &nbsp; &nbsp;4. malloc的返回值为void*, 在使用时必须强转，new不需要，因为new后跟的是空间的类型; <br> &nbsp; &nbsp;5. malloc申请空间失败时，返回的是NULL，因此使用时必须判空，new不需要，但是new需要捕获异常; <br> &nbsp; &nbsp;6. 申请自定义类型对象时，malloc/free只会开辟空间，不会调用构造函数与析构函数，而new在申请空间后会调用构造函数完成对象的初始化，delete在释放空间前会调用析构函数完成空间中资源的清理.</blockquote>', '内存分布：\n首先我们需要了解的是C/C++中内存区域的划分：\n1. 栈又叫堆栈--非静态局部变量/函数参数/返回值等等，栈是向下增长的：先调用的地址比后调用的地址大。 2. 内存映射段是高效的I/O映射方式，用于装载一个共享的动态内存库。用户可使用系统接口 创建共享共享内存，做进程间通信。 3. 堆用于程序运行时动态内存分配，堆是可以上增长的：先调用的地址比后调用的地址小。 4. 数据段--存储全局数据和静态数据。 5. 代码段--可执行的代码/只读常量。\n当我们懂了内存分布，可以尝试练习：\n是', '2025/02/05/72ff7b28-cff5-479a-bd6c-8912d6344e1b.webp', 32, '青柠衬酸', '2025-02-14 12:12:29', '2025-02-14 12:12:29', 3, 1, 3, 'C/C++', 3, NULL, 11);
INSERT INTO `article` VALUES (133, 'Mybatis 常用配置', '<h2 style=\"text-align: start;\">一、Mybatis 在 SpringBoot 中用 xml 配置文件实现</h2><h3 style=\"text-align: start;\">1、在 application.properties 配置文件中新增如下配置</h3><h4 style=\"text-align: start;\">1.1、SpringBoot 框架下默认配置以下两个</h4><pre style=\"text-align: left;\"><code>mybatis.configuration.log-impl=org.apache.ibatis.logging.stdout.StdOutImpl\nmybatis.configuration.map-underscore-to-camel-case=true</code></pre><h4 style=\"text-align: start;\">1.2、新增以下两条</h4><pre style=\"text-align: left;\"><code># 无需使用，配置后报错，目前不懂为什么，只需配置 mybatis.mapper-locations\n# mybatis.config-location=classpath:mybatis-config.xml\n\n# *.xml 为目录mappers下全部 .xml 文件\nmybatis.mapper-locations=classpath:mappers/*.xml</code></pre><h2 style=\"text-align: start;\">二、mybatis 的 xml 模板</h2><h3 style=\"text-align: start;\">1、mybatis-config.xml 模板</h3><pre style=\"text-align: left;\"><code class=\"language-xml\">&lt;?xml version=\"1.0\" encoding=\"UTF-8\" ?&gt;\n&lt;!DOCTYPE configuration\n        PUBLIC \"-//mybatis.org//DTD Config 3.0//EN\"\n        \"http://mybatis.org/dtd/mybatis-3-config.dtd\"&gt;\n&lt;configuration&gt;\n\n    &lt;!-- environments表示配置Mybatis的开发环境，可以配置多个环境，在众多具体环境中，使用default属性指定实际运行时使用的环境。default属性的取值是environment标签的id属性的值。 --&gt;\n    &lt;environments default=\"development\"&gt;\n        &lt;!-- environment表示配置Mybatis的一个具体的环境 --&gt;\n        &lt;environment id=\"development\"&gt;\n            &lt;!-- Mybatis的内置的事务管理器 --&gt;\n            &lt;transactionManager type=\"JDBC\"/&gt;\n            &lt;!-- 配置数据源 --&gt;\n            &lt;dataSource type=\"POOLED\"&gt;\n                &lt;!-- 建立数据库连接的具体信息 --&gt;\n                &lt;property name=\"driver\" value=\"com.mysql.cj.jdbc.Driver\"/&gt;\n                &lt;property name=\"url\" value=\"jdbc:mysql://localhost:3306/qxfly\"/&gt;\n                &lt;property name=\"username\" value=\"root\"/&gt;\n                &lt;property name=\"password\" value=\"123456\"/&gt;\n            &lt;/dataSource&gt;\n        &lt;/environment&gt;\n    &lt;/environments&gt;\n\n    &lt;!-- Mapper注册：指定Mybatis映射文件的具体位置 --&gt;\n        &lt;!-- mapper标签：配置一个具体的Mapper映射文件 --&gt;\n        &lt;!-- resource属性：指定Mapper映射文件的实际存储位置，这里需要使用一个以类路径根目录为基准的相对路径 --&gt;\n        &lt;!--    对Maven工程的目录结构来说，resources目录下的内容会直接放入类路径，所以这里我们可以以resources目录为基准 --&gt;\n    &lt;mappers&gt;\n        &lt;mapper resource=\"mappers/LoginMapper.xml\"/&gt;\n    &lt;/mappers&gt;\n\n&lt;/configuration&gt;</code></pre><h3 style=\"text-align: start;\">2、mapper.xml 模板</h3><pre style=\"text-align: left;\"><code class=\"language-xml\">&lt;?xml version=\"1.0\" encoding=\"UTF-8\" ?&gt;\n&lt;!DOCTYPE mapper\n        PUBLIC \"-//mybatis.org//DTD Mapper 3.0//EN\"\n        \"https://mybatis.org/dtd/mybatis-3-mapper.dtd\"&gt;\n&lt;!-- namespace等于mapper接口类的全限定名,这样实现对应 --&gt;\n&lt;mapper namespace=\"top.qxfly.mapper.LoginMapper\"&gt;\n    &lt;select id=\"login\" resultType=\"top.qxfly.pojo.User\"&gt;\n        select * from user where username = #{username} and password = #{password}\n    &lt;/select&gt;\n&lt;/mapper&gt;</code></pre><p><br></p>', '一、Mybatis 在 SpringBoot 中用 xml 配置文件实现\n1、在 application.properties 配置文件中新增如下配置\n1.1、SpringBoot 框架下默认配置以下两个\nmybatis.configuration.log-impl=org.apache.ibatis.logging.stdout.StdOutImpl\nmybatis.configuration.map-underscore-to-camel-case=true\n1.2、新增以下两条\n# 无需使', '2025/02/05/7460cf0a-1a81-4e4f-8ff9-eae02535fd1e.webp', 2, 'test', '2025-02-15 20:56:28', '2025-02-15 20:56:28', 1, 0, 0, 'Java,SpringBoot', 3, '编程', 11);
INSERT INTO `article` VALUES (134, '基础算法：矩阵相乘 ', '<h3 style=\"text-align: start;\">概念：</h3><blockquote style=\"text-align: start;\">矩阵相乘 例如： {{1,1},{1,4}}; {{2,2},{1,1}}; 得：{{3,3},{6,6}};</blockquote><h3 style=\"text-align: start;\"> 示例：</h3><p> &nbsp;java：</p><pre><code class=\"language-java\">public class ju_zheng {\n    public static void main(String[] args){\n        int[][] num1 = {{1,1},{1,4}};//  1   1     2  1\n        int[][] num2 = {{2,2},{1,1}};//  1   1     1  1\n        int[][] num = new int[2][2];\n        int temp = 0;\n        for(int i = 0; i &lt; 2; i++){\n            for(int j = 0; j &lt; 2; j++){\n                for(int k = 0; k &lt; 2; k++){\n                    num[i][k] +=  num1[i][j] * num2[j][k];\n                }\n            }\n        }\n        for(int i = 0; i &lt; 2; i++){\n            for(int j = 0; j &lt; 2; j++){\n                System.out.print(num[i][j] + \" \");\n            }\n            System.out.println();\n        }\n    }\n}</code></pre><p><br></p>', '概念：\n矩阵相乘 例如： {{1,1},{1,4}}; {{2,2},{1,1}}; 得：{{3,3},{6,6}};\n 示例：\n  java：\npublic class ju_zheng {\n    public static void main(String[] args){\n        int[][] num1 = {{1,1},{1,4}};//  1   1     2  1\n        int[][] num2 = {{2,2},{1,1}};//  1   1     1 ', '2025/02/05/2b92ae69-fb76-42e0-a1a4-0a83a5e62f62.webp', 2, 'test', '2025-02-16 20:58:44', '2025-02-16 20:58:44', 0, 0, 0, 'Java,数据结构,数据结构与算法,算法', 2, '编程', 11);
INSERT INTO `article` VALUES (135, 'postgresql数据库常用命令', '<h3>启动、重启、停止 PostgreSQL 服务</h3><blockquote>sudo systemctl start postgresql<br>sudo systemctl stop postgresql<br>sudo systemctl restart postgresql</blockquote><p><br></p><h3>设置开机自动启动服务</h3><blockquote>chkconfig postgresql on</blockquote><h3>登录</h3><blockquote>sudo -u postgres psql</blockquote><h3>控制台命令</h3><blockquote>\\h：查看 SQL 命令的解释，比如\\h select。<br>\\?：查看 psql 命令列表。<br>\\l：列出所有数据库。<br>\\c [database_name]：连接其他数据库。<br>\\d：列出当前数据库的所有表格。<br>\\d [table_name]：列出某一张表格的结构。<br>\\du：列出所有用户。<br>\\e：打开文本编辑器。<br>\\conninfo：列出当前数据库和连接的信息。</blockquote>', '启动、重启、停止 PostgreSQL 服务\nsudo systemctl start postgresql\nsudo systemctl stop postgresql\nsudo systemctl restart postgresql\n\n设置开机自动启动服务\nchkconfig postgresql on\n登录\nsudo -u postgres psql\n控制台命令\n\\h：查看 SQL 命令的解释，比如\\h select。\n\\?：查看 psql 命令列表。\n\\l：列出所有数据库。\n\\c [d', '2025/02/05/18dab976-bc4e-4e18-8211-fc29d9f7a11a.webp', 2, 'test', '2025-02-17 21:07:08', '2025-02-17 21:07:08', 4, 1, 1, '数据库', 3, '数据库', 11);
INSERT INTO `article` VALUES (136, 'win7vue', '<p>npm i -g nrm</p><p>nrm use taobao</p><p>npm i -g @vue/cli</p><p>下载链接</p><p> <a href=\"https://update.code.visualstudio.com/1.70.2/win32-x64-user/stable\" target=\"_blank\">VSCode1.70.2.exe</a> </p><p> <a href=\"https://d0.ananas.chaoxing.com/download/22585c1a6808f3f7d5fcd176304fe3a3?at_=1715588012211&ak_=e3d5710b8a90fbe924eb030f9faeb7b8&ad_=45182101579290a7726f7b46aac8f6e3&fn=demo.rar\" target=\"_blank\">demo</a> </p>', 'npm i -g nrm\nnrm use taobao\nnpm i -g @vue/cli\n下载链接\n VSCode1.70.2.exe \n demo ', '2025/02/05/1fadb6fe-9f4c-4d49-8f3a-ffe37c516d9f.webp', 1, 'qxfly', '2025-02-18 12:58:38', '2025-02-18 12:58:38', 7, 2, 2, 'Vue', 3, '编程', 11);
INSERT INTO `article` VALUES (140, 'Linux 定时任务crontab使用方法', '<p style=\"text-align: start;\"><strong>查看当前定时任务：</strong></p><pre style=\"text-align: start;\"><code class=\"language-bash hljs\">crontab -l</code></pre><p style=\"text-align: start;\"><strong>添加修改删除定时任务：</strong></p><pre style=\"text-align: start;\"><code class=\"language-bash hljs\">crontab -e</code></pre><p style=\"text-align: start;\"><strong>添加修改需要重启服务：</strong></p><pre><code >service cron restart</code></pre><p style=\"text-align: start;\"><strong>参数说明：</strong></p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">m h &nbsp;dom mon dow &nbsp;command</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">m 分钟 0-59</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">h 小时 0-23</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">dow 天1-31</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">mon 月 1-12</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">dow &nbsp;星期 1-6 &nbsp;0表示星期天</p><p style=\"text-indent: 2em; text-align: start; line-height: 1;\">command 就是要执行的命令</p><p><strong>示例：</strong></p><pre><code >* * * * *                  # 每隔一分钟执行一次任务\n0 * * * *                  # 每小时的0点执行一次任务\n0,30 * 5 * *               # 每个月5号的每小时的0分和30分执行\n*/3,*/5 * * * *            # 每隔3分钟或5分钟执行一次任务\n30 8 * * 6,0		       # 每周六日的8点30分执行一次\n0 8-18/1 * * 1-5	       # 上班期间，每小时执行一次。\n0 18-8/1 * * 1-5	       # 下班期间，每小时执行一次。</code></pre><p><strong>具体示例：</strong></p><pre><code >//每天1点执行\n0 1 * * * /qxfly/GitSoftware/linux-x64/Ray.BiliBiliTool.Console\n//每天2点执行\n0 2 * * * python3 /qxfly/GitSoftware/MihoyoBBSTools-master/main.py\n\n</code></pre><p><br></p>', '查看当前定时任务：\ncrontab -l\n添加修改删除定时任务：\ncrontab -e\n添加修改需要重启服务：\nservice cron restart\n参数说明：\nm h  dom mon dow  command\nm 分钟 0-59\nh 小时 0-23\ndow 天1-31\nmon 月 1-12\ndow  星期 1-6  0表示星期天\ncommand 就是要执行的命令\n示例：\n* * * * *                  # 每隔一分钟执行一次任务\n0 * * * *         ', '2025/05/11/b5aac372-af7d-4cf5-9e5f-7e271c8324f0.webp', 1, 'qxfly', '2025-02-21 21:02:36', '2025-05-11 13:21:51', 5, 1, 1, 'Linux,Ubuntu,操作系统', 3, 'Linux', 11);
INSERT INTO `article` VALUES (141, 'JavaFX Maven打包后通过jpackage打包成exe', '<p><br></p><pre><code >jpackage --name appName --module com.jinyx/com.jinyx.DesktopAppKt --runtime-image ./target/app/ --icon /Users/jinyx/img_logo.icns --type app-image</code></pre><ul><li style=\"text-align: start;\">--name: 打包的应用程序名</li><li style=\"text-align: start;\">--module: 对应 javafx-maven-plugin 中配置的 mainClass</li><li style=\"text-align: start;\">--runtime-image: jlink 打出的包</li><li style=\"text-align: start;\">--icon: 指定应用图标，macOS 测试需要 icns 类型图标；<a href=\"https://links.jianshu.com/go?to=https%3A%2F%2Fwww.aconvert.com%2Fcn%2Fimage%2Fpng-to-icns%2F\" target=\"_blank\">png 转 icns</a></li><li style=\"text-align: start;\">--type: 指定打包类型；例如我当前系统可选的值有 {\"app-image\", \"dmg\", \"pkg\"}</li></ul><p><br></p>', '\njpackage --name appName --module com.jinyx/com.jinyx.DesktopAppKt --runtime-image ./target/app/ --icon /Users/jinyx/img_logo.icns --type app-image\n--name: 打包的应用程序名\n--module: 对应 javafx-maven-plugin 中配置的 mainClass\n--runtime-image: jlink 打出的包\n--icon: 指', '2025/05/11/fe54d580-eec6-4e25-a3c0-d25489e692b9.webp', 1, 'qxfly', '2025-02-22 19:08:24', '2025-05-11 13:21:36', 2, 0, 0, 'Java', 3, '编程', 11);
INSERT INTO `article` VALUES (142, 'Qt6：QGraphicsView鼠标拖拽和滚轮缩放实现', '<p>通过新建类 <strong>MyQGraphicsView 继承 QGraphicsView 。</strong></p><ol><li>重写 <strong>wheelEvent </strong>方法实现滚轮缩放<strong>。</strong></li><li>重写<strong> mouseMoveEvent</strong>、<strong>mousePressEvent </strong>等鼠标事件实现拖拽。</li><li>或者设置 <code>this-&gt;myQGraphicsView-&gt;setDragMode(QGraphicsView::ScrollHandDrag);</code>开启拖拽</li><li>创建新类并调用。</li></ol><pre><code class=\"language-cpp\">MyQGraphicsView *myQGraphicsView = new MyQGraphicsView();</code></pre><p><u><strong>MyQGraphicsView.h</strong></u></p><pre><code class=\"language-cpp\">#ifndef UNTITLED_MYQGRAPHICSVIEW_\n#define UNTITLED_MYQGRAPHICSVIEW_\n\n\n#include &lt;QGraphicsItem&gt;\n#include &lt;QGraphicsView&gt;\n\nclass MyQGraphicsView : public QGraphicsView {\nQ_OBJECT\nprivate:\n    QPoint startPoint;\n    QGraphicsItem *item;\n    \n    double SCALE_UP = 1.05;\n    double SCALE_DOWN = 0.95;\n    QSize originPreImgSize;\n    QSize changedPreImgSize;\npublic:\n    MyQGraphicsView(QWidget *parent = nullptr) : QGraphicsView(parent) {}\n\nprotected:\n    void wheelEvent(QWheelEvent *event) override;\n\n    //可不自己实现拖拽，设置this-&gt;myQGraphicsView-&gt;setDragMode(QGraphicsView::ScrollHandDrag);这个开启拖拽\n    void mouseMoveEvent(QMouseEvent *event) override;\n    void mousePressEvent(QMouseEvent *event) override;\n};\n\n\n#endif //UNTITLED_MYQGRAPHICSVIEW_\n</code></pre><p><u><strong>MyQGraphicsView.cpp</strong></u></p><pre><code class=\"language-cpp\">#include &lt;QWheelEvent&gt;\n#include \"MyQGraphicsView\"\n\n//1、普通缩放\nvoid MyQGraphicsView::wheelEvent(QWheelEvent *event) {\n    QGraphicsView::wheelEvent(event);\n    if (event-&gt;angleDelta().ry() &gt; 0) {\n        this-&gt;setTransform(this-&gt;transform().scale(1.1, 1.1));\n    } else {\n        this-&gt;setTransform(this-&gt;transform().scale(0.9, 0.9));\n    }\n}\n//2、其他缩放，设置最大最小范围\nvoid MyQGraphicsView::wheelEvent(QWheelEvent *event) {\n    double ratio = (double) changedPreImgSize.width() / originPreImgSize.width();\n    if (event-&gt;angleDelta().ry() &gt; 0) {\n        if (ratio &lt; 30) {\n            scale(SCALE_UP, SCALE_UP);\n            changedPreImgSize.setWidth(changedPreImgSize.width() * SCALE_UP);\n        }\n\n    } else {\n        if (ratio &gt; 0.1) {\n            scale(SCALE_DOWN, SCALE_DOWN);\n            changedPreImgSize.setWidth(changedPreImgSize.width() * SCALE_DOWN);\n        }\n    }\n}\n\n//可不自己实现拖拽，设置this-&gt;myQGraphicsView-&gt;setDragMode(QGraphicsView::ScrollHandDrag);这个开启拖拽\nvoid MyQGraphicsView::mouseMoveEvent(QMouseEvent *event) {\n    QPointF p = this-&gt;mapToScene(event-&gt;pos()) - mapToScene(startPoint);\n    item-&gt;setPos(item-&gt;pos() + p);\n    startPoint = event-&gt;pos();\n    QGraphicsView::mouseMoveEvent(event);\n}\n\nvoid MyQGraphicsView::mousePressEvent(QMouseEvent *event) {\n    QGraphicsView::mousePressEvent(event);\n    QGraphicsItem *temp = this-&gt;itemAt(event-&gt;pos());\n    if (temp != nullptr)item = temp;\n    startPoint = event-&gt;pos();\n}\n\n</code></pre><p><br></p>', '通过新建类 MyQGraphicsView 继承 QGraphicsView 。\n重写 wheelEvent 方法实现滚轮缩放。\n重写 mouseMoveEvent、mousePressEvent 等鼠标事件实现拖拽。\n或者设置 this->myQGraphicsView->setDragMode(QGraphicsView::ScrollHandDrag);开启拖拽\n创建新类并调用。\nMyQGraphicsView *myQGraphicsView = new MyQGraphicsView(', '2025/02/05/edc3776f-f4b3-4265-91da-72edb58cfd68.webp', 1, 'qxfly', '2025-02-23 19:32:40', '2025-02-23 19:32:40', 4, 0, 0, 'Qt,C/C++', 3, '编程', 11);
INSERT INTO `article` VALUES (143, ' 7z分卷压缩包：**.7z.001zstd 解压缩', '<p>在cmd里使用以下命令把分卷压缩包合并成一个，即可正常解压缩。</p><pre><code >copy /b test.7z.* test.7z</code></pre><p><br></p>', '在cmd里使用以下命令把分卷压缩包合并成一个，即可正常解压缩。\ncopy /b test.7z.* test.7z\n', '2025/05/11/43599ca4-6c98-4ff6-aabb-c8d552d984a5.webp', 1, 'qxfly', '2025-02-24 03:23:23', '2025-05-11 13:18:53', 5, 0, 0, '软件教程,软件使用', 3, '软件', 11);
INSERT INTO `article` VALUES (144, 'C++获取屏幕分辨率', '<p>C++获取屏幕分辨率</p><pre><code class=\"language-cpp\">HDC screen_dc = GetDC(nullptr);\n// 获取设备独立像素 (DIP) 的分辨率\nint width = GetDeviceCaps(screen_dc, DESKTOPHORZRES);\nint height = GetDeviceCaps(screen_dc, DESKTOPVERTRES);\n// 释放设备上下文\nReleaseDC(nullptr, screen_dc);</code></pre><p><br></p>', 'C++获取屏幕分辨率\nHDC screen_dc = GetDC(nullptr);\n// 获取设备独立像素 (DIP) 的分辨率\nint width = GetDeviceCaps(screen_dc, DESKTOPHORZRES);\nint height = GetDeviceCaps(screen_dc, DESKTOPVERTRES);\n// 释放设备上下文\nReleaseDC(nullptr, screen_dc);\n', '2025/05/11/946bd7a0-0fb7-4e59-92c8-1acc48e97449.webp', 1, 'qxfly', '2025-02-24 23:35:37', '2025-05-11 13:18:40', 1, 0, 0, '', 3, '编程', 11);
INSERT INTO `article` VALUES (145, 'Qt6：QTableWidget点击表头自定义排序。', '<blockquote>通过继承 <strong>QTableWidgetItem </strong>并重写<strong> operator&lt; </strong>函数实现自定义排序。</blockquote><p><u><strong>MyQTableWidgetItem.h</strong></u></p><pre><code class=\"language-cpp\">#include &lt;QTableWidgetItem&gt;\n\nclass MyQTableWidgetItem : public QTableWidgetItem {\npublic:\n    //自定义枚举类型，用于区分用于区分不同自定义表格内容类型的排序。可能有其它方法，但是我只想到这种。\n    enum SortType {\n        Size = 0,\n        Resolution = 1,\n    };\nprivate:\n    SortType sortType;\npublic:\n    explicit MyQTableWidgetItem(MyQTableWidgetItem::SortType sortType);\n\n    bool operator&lt;(const QTableWidgetItem &other) const override;\n\n};</code></pre><p><u><strong>MyQTableWidgetItem.cpp</strong></u></p><pre><code class=\"language-cpp\">#include \"MyQTableWidgetItem.h\"\n\nMyQTableWidgetItem::MyQTableWidgetItem(MyQTableWidgetItem::SortType sortType) {\n    this-&gt;sortType = sortType;\n}\n\nbool MyQTableWidgetItem::operator&lt;(const QTableWidgetItem &other) const {\n    QString str1 = data(0).toString();\n    QString str2 = other.data(0).toString();\n    //比较两者中有空参时。\n    if (str1.isEmpty() || str2.isEmpty()) return true;\n    \n    //第一种类型，文件大小：12.3456 MB\n    if (sortType == SortType::Size) {\n       //从后往前截掉 n 个。例：12.3456 MB-&gt; 12.3456\n        double a = str1.chopped(3).toDouble();\n        double b = str2.chopped(3).toDouble();\n        return a &lt; b;\n    } else if (sortType == SortType::Resolution) {\n        //第二种类型，分辨率：1234x5678\n        QList&lt;QString&gt; list1 = str1.split(\"x\");\n        QList&lt;QString&gt; list2 = str2.split(\"x\");\n        long a = list1[0].toInt() * list1[1].toInt();\n        long b = list2[0].toInt() * list2[1].toInt();\n        return a &lt; b;\n    }\n    //其他类型使用默认\n    return QTableWidgetItem::operator&lt;(other);\n}\n</code></pre><h1>具体使用方法：</h1><p><u><strong>Test.cpp</strong></u></p><pre><code class=\"language-cpp\">void test::setHeaderClickSort(int col) {\n\n    QString label = this-&gt;table-&gt;horizontalHeaderItem(col)-&gt;text();\n    if (label == \"大小\") {\n        for (int i = 0; i &lt; this-&gt;table-&gt;rowCount(); i++) {\n            MyQTableWidgetItem *item = new MyQTableWidgetItem(MyQTableWidgetItem::Size);\n            //第二个参数为进行比较的元素，个人理解\n            item-&gt;setData(Qt::DisplayRole, QVariant(this-&gt;table-&gt;item(i, col)-&gt;text()));\n            this-&gt;table-&gt;setItem(i, col, item);\n        }\n    } else if (label == \"分辨率\") {\n        for (int i = 0; i &lt; this-&gt;table-&gt;rowCount(); i++) {\n            MyQTableWidgetItem *item = new MyQTableWidgetItem(MyQTableWidgetItem::Resolution);\n            item-&gt;setData(Qt::DisplayRole, QVariant(this-&gt;table-&gt;item(i, col)-&gt;text()));\n            this-&gt;table-&gt;setItem(i, col, item);\n        }\n    }\n    //通过记录上一次排序，得出本次应该使用什么排序，以实现排序的切换。\n\n    Qt::SortOrder order = this-&gt;sortOrder[col] == Qt::AscendingOrder ? Qt::DescendingOrder : Qt::AscendingOrder;\n    this-&gt;sortOrder[col] = order;\n    this-&gt;table-&gt;sortItems(col, order);\n}</code></pre><p><u>参考原文： </u><a href=\"https://geek-docs.com/pyqt/pyqt-questions/142_hk_1709422237.html#google_vignette\" target=\"_blank\"><u>https://geek-docs.com/pyqt/pyqt-questions/142_hk_1709422237.html#google_vignette</u></a><u> </u></p>', '通过继承 QTableWidgetItem 并重写 operator< 函数实现自定义排序。\nMyQTableWidgetItem.h\n#include <QTableWidgetItem>\n\nclass MyQTableWidgetItem : public QTableWidgetItem {\npublic:\n    //自定义枚举类型，用于区分用于区分不同自定义表格内容类型的排序。可能有其它方法，但是我只想到这种。\n    enum SortType {\n        Size = 0,', '2025/02/05/257601ee-6167-4a8f-b065-2f019111cc58.webp', 1, 'qxfly', '2025-02-24 23:58:42', '2025-02-24 23:58:42', 5, 0, 0, 'C/C++,Qt', 3, '编程', 11);
INSERT INTO `article` VALUES (146, 'Android Studio项目gradle依赖下载慢问题解决方法', '<table style=\"width: auto; text-align: center;\"><tbody><tr><th colspan=\"1\" rowspan=\"1\" width=\"auto\">源库</th><th colspan=\"1\" rowspan=\"1\" width=\"auto\">阿里云的镜像地址</th></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"auto\">google()</td><td colspan=\"1\" rowspan=\"1\" width=\"auto\">https://maven.aliyun.com/repository/google</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"auto\">mavenCentral()</td><td colspan=\"1\" rowspan=\"1\" width=\"auto\">https://maven.aliyun.com/repository/central</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"auto\">gradlePluginPortal()</td><td colspan=\"1\" rowspan=\"1\" width=\"auto\">https://maven.aliyun.com/repository/gradle-plugin</td></tr></tbody></table><blockquote style=\"text-align: start;\">提示：上面仅列出使用到的镜像源，全量镜像源请见<span style=\"font-size: 16px;\">阿里云常见镜像库：https://developer.aliyun.com/mvn/guide</span></blockquote><p style=\"text-align: start;\">使用方式如下：</p><p style=\"text-align: start;\">修改<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>settings.gradle.kts</code></span>，将对应阿里云镜像仓库添加到<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>google()</code></span>和<span style=\"color: rgb(199, 37, 78); background-color: rgb(249, 242, 244); font-size: 14px;\"><code>mavenCentral()</code></span>上方，优先从国内源下载，如果没有再去原网站下。</p><pre style=\"text-align: start;\"><code class=\"language-xml\">pluginManagement {\n    repositories {\n        // 使用阿里镜像源\n        maven(url = \"https://maven.aliyun.com/repository/google\")\n        maven(url = \"https://maven.aliyun.com/repository/central\")\n        maven(url = \"https://maven.aliyun.com/repository/gradle-plugin\")\n        google()\n        mavenCentral()\n        gradlePluginPortal()\n    }\n}\ndependencyResolutionManagement {\n    repositoriesMode.set(RepositoriesMode.FAIL_ON_PROJECT_REPOS)\n    repositories {\n        // 使用阿里镜像源\n        maven(url = \"https://maven.aliyun.com/repository/google\")\n        maven(url = \"https://maven.aliyun.com/repository/central\")\n        google()\n        mavenCentral()\n    }\n}\n\nrootProject.name = \"Demo\"\ninclude(\":app\")</code></pre><p><br></p>', '源库阿里云的镜像地址google()https://maven.aliyun.com/repository/googlemavenCentral()https://maven.aliyun.com/repository/centralgradlePluginPortal()https://maven.aliyun.com/repository/gradle-plugin\n提示：上面仅列出使用到的镜像源，全量镜像源请见阿里云常见镜像库：https://developer.aliyun.com/mv', '2025/02/05/7ceb5ac5-5aba-4eef-9c55-8887f89bab98.webp', 1, 'qxfly', '2025-02-25 20:40:53', '2025-02-25 20:40:53', 2, 0, 0, '开发工具,软件教程', 3, '教程', 11);
INSERT INTO `article` VALUES (147, 'Qt+ffmpeg开发因太难而中道崩殂', '<h1>开发环境配置</h1><ol><li>在构建文件夹如：cmake-build-debug 中添加 ffmpeg的bin目录下的动态链接库文件</li><li>把include和lib目录放置项目目录中或随便。</li><li>在CMakeLists.txt添加修改以下内容，路径为对应 步骤2 文件实际所在路径，导入库</li></ol><pre><code >link_libraries(\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avcodec.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avdevice.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avfilter.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avformat.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avutil.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/postproc.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/swresample.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/swscale.lib\n)\ninclude_directories(\n\n        src/FFmpeg/include\n)\n</code></pre><p>敲到一半的代码</p><pre><code >//\n// Created by 25415 on 2024/8/15.\n//\nextern \"C\" {\n#include &lt;libavcodec/avcodec.h&gt;   //编码\n#include &lt;libavdevice/avdevice.h&gt;\n#include &lt;libavformat/avformat.h&gt;  //封装格式处理\n#include &lt;libavutil/error.h&gt;\n#include &lt;libswscale/swscale.h&gt;  //像素处理\n#include &lt;libswresample/swresample.h&gt;  //缩放\n};\n\n#include &lt;QPushButton&gt;\n#include &lt;QLabel&gt;\n#include \"FFmpageTest.h\"\n#include &lt;cstdio&gt;\n#include \"QMediaPlayer\"\n#include \"QVideoWidget\"\n\n#define qout qDebug()\n\nFFmpageTest::FFmpageTest(QWidget *parent) {\n}\n\nvoid FFmpageTest::ffmpeg() {\n    AVPacket *pAVPacket = 0;                        // ffmpag单帧数据包\n    AVFrame *pAVFrame = 0;                          // ffmpeg单帧缓存\n    AVFrame *pAVFrameRGB32 = 0;                     // ffmpeg单帧缓存转换颜色空间后的缓存\n    int ret = 0;                                    // 函数执行结果\n    int videoIndex = -1;                            // 音频流所在的序号\n    int gotPicture = 0;                             // 解码时数据是否解码成功\n    int numBytes = 0;                               // 解码后的数据长度\n    uchar *outBuffer = 0;\n\n\n    printf(\"Hello FFMPEG, version is %s\\n\", av_version_info());\n    AVFormatContext *forContent;//用来保存视频相关信息的结构体\n    forContent = avformat_alloc_context();//分配空间\n\n    //打开视频文件\n    int res = avformat_open_input(&forContent, \"G:\\\\考研\\\\高数\\\\02.高等数学\\\\01.高数引言\\\\01.高数引言.mp4\",\n                                  nullptr, nullptr);\n    if (res != 0)//判断是否打开视频文件\n    {\n        qDebug() &lt;&lt; \"无法打开视频文件\";\n        return;\n    }\n    avformat_find_stream_info(forContent, nullptr);\n\n    //一个视频流有多股码流，存在forContentext中streams数组中\n    int videoType = -1;\n    //nb_streams代表封装格式里面的结构体信息有几个，正常两个：音频信息、视频信息\n    for (int i = 0; i &lt; forContent-&gt;nb_streams; i++) //i小于流的个数\n    {\n        if (forContent-&gt;streams[i]-&gt;codecpar-&gt;codec_type == AVMEDIA_TYPE_VIDEO)//视频流\n        {\n            videoType = i;//标识类型\n            break;\n        }\n    }\n    //判断是否有视频流信息\n    if (videoType == -1) {\n        qDebug() &lt;&lt; \"没有视频流相关信息\";\n        return;\n    }\n    int audio_index_ = av_find_best_stream(forContent, AVMEDIA_TYPE_AUDIO, -1, -1, NULL, 0);\n    int video_index_ = av_find_best_stream(forContent, AVMEDIA_TYPE_VIDEO, -1, -1, NULL, 0);\n\n    int time = forContent-&gt;duration / (AV_TIME_BASE / 1000);\n    qout &lt;&lt; \"time\" &lt;&lt; time;\n    AVStream *videoStream = forContent-&gt;streams[video_index_];\n    AVStream *audioStream = forContent-&gt;streams[audio_index_];\n    qout &lt;&lt; \"width\" &lt;&lt; videoStream-&gt;codecpar-&gt;width;\n    qout &lt;&lt; \"height\" &lt;&lt; videoStream-&gt;codecpar-&gt;height;\n    qout &lt;&lt; \"avg_frame_rate\" &lt;&lt; videoStream-&gt;avg_frame_rate.num / videoStream-&gt;avg_frame_rate.den;  // 视频帧率\n\n    // 通过解码器ID获取视频解码器（新版本返回值必须使用const）\n    const AVCodec *codec = avcodec_find_decoder(videoStream-&gt;codecpar-&gt;codec_id);\n    int64_t m_totalFrames = videoStream-&gt;nb_frames;\n    AVCodecContext *pAVCodecContext = avcodec_alloc_context3(codec);\n    int a = avcodec_open2(pAVCodecContext, codec, NULL);\n    SwsContext *pSwsContext = sws_getContext(pAVCodecContext-&gt;width,\n                                 pAVCodecContext-&gt;height,\n                                 pAVCodecContext-&gt;pix_fmt,\n                                 pAVCodecContext-&gt;width,\n                                 pAVCodecContext-&gt;height,\n                                 AV_PIX_FMT_RGBA,\n                                 SWS_FAST_BILINEAR,\n                                 0,\n                                 0,\n                                 0);\n    numBytes = avpicture_get_size(AV_PIX_FMT_RGBA,\n                                  pAVCodecContext-&gt;width,\n                                  pAVCodecContext-&gt;height);\n    outBuffer = (uchar *)av_malloc(numBytes);\n    // pAVFrame32的data指针指向了outBuffer\n    avpicture_fill((AVPicture *)pAVFrameRGB32,\n                   outBuffer,\n                   AV_PIX_FMT_RGBA,\n                   pAVCodecContext-&gt;width,\n                   pAVCodecContext-&gt;height);\n    // 此处无需分配\n    // av_read_frame时他会分配，av_new_packet多此一举，正好解释了一次new和多次free的问题\n//    av_new_packet(pAVPacket, pAVCodecContext-&gt;width * pAVCodecContext-&gt;height);\n    // 步骤七：读取一帧数据的数据包\n    while(av_read_frame(forContent, pAVPacket) &gt;= 0)\n    {\n        if(pAVPacket-&gt;stream_index == video_index_)\n        {\n            avcodec_send_packet()\n\n            // 步骤八：对读取的数据包进行解码\n            ret = avcodec_decode_video2(pAVCodecContext, pAVFrame, &gotPicture, pAVPacket);\n            // 等于0代表拿到了解码的帧数据\n            if(!gotPicture)\n            {\n                break;\n            }else{\n                sws_scale(pSwsContext,\n                          (const uint8_t * const *)pAVFrame-&gt;data,\n                          pAVFrame-&gt;linesize,\n                          0,\n                          pAVCodecContext-&gt;height,\n                          pAVFrameRGB32-&gt;data,\n                          pAVFrameRGB32-&gt;linesize);\n                QImage imageTemp((uchar *)outBuffer,\n                                 pAVCodecContext-&gt;width,\n                                 pAVCodecContext-&gt;height,\n                                 QImage::Format_RGBA8888);\n                QImage image = imageTemp.copy();\n                LOG &lt;&lt; image.save(\"1.jpg\");\n            }\n            av_free_packet(pAVPacket);\n        }\n        QThread::msleep(100);\n}\n</code></pre><p><br></p>', '开发环境配置\n在构建文件夹如：cmake-build-debug 中添加 ffmpeg的bin目录下的动态链接库文件\n把include和lib目录放置项目目录中或随便。\n在CMakeLists.txt添加修改以下内容，路径为对应 步骤2 文件实际所在路径，导入库\nlink_libraries(\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/avcodec.lib\n        ${PROJECT_SOURCE_DIR}/src/FFmpeg/lib/', '2025/05/11/e5eba5cd-768a-44cd-bda4-723c3f7559c7.webp', 1, 'qxfly', '2025-02-26 00:32:24', '2025-05-11 13:17:44', 6, 0, 0, 'Qt', 3, '编程', 11);
INSERT INTO `article` VALUES (151, '浏览器指纹--纯js拿到浏览器指纹', '<p style=\"text-align: start;\"><span style=\"background-color: rgb(255, 255, 153); font-size: 14px;\">Canvas指纹</span></p><p style=\"text-align: start;\"><span style=\"font-size: 14px;\"> 从根本上来说，每一种浏览器都会使用不同的图像处理引擎，不同的导出选项，不同的压缩等级，所以每一台电脑绘制出的图形都会有些许不同，这些图案可以被用来给用户设备分配特定编号（指纹），也就是说可以用来识别不同用户。</span></p><p><br></p><pre><code class=\"language-javascript\">function bin2hex(s) {\n  var i, l, o = \'\',\n    n;\n\n  s += \'\';\n\n  for (i = 0, l = s.length; i &lt; l; i++) {\n    n = s.charCodeAt(i)\n      .toString(16);\n    o += n.length &lt; 2 ? \'0\' + n : n;\n  }\n\n  return o;\n}\n\nfunction getUUID(domain) {\n    var canvas = document.createElement(\'canvas\');\n    var ctx = canvas.getContext(\"2d\");\n    var txt = domain;\n    ctx.textBaseline = \"top\";\n    ctx.font = \"14px \'Arial\'\";\n    ctx.textBaseline = \"tencent\";\n    ctx.fillStyle = \"#f60\";\n    ctx.fillRect(125,1,62,20);\n    ctx.fillStyle = \"#069\";\n    ctx.fillText(txt, 2, 15);\n    ctx.fillStyle = \"rgba(102, 204, 0, 0.7)\";\n    ctx.fillText(txt, 4, 17);\n\n    var b64 = canvas.toDataURL().replace(\"data:image/png;base64,\",\"\");\n    var bin = atob(b64);\n    var crc = bin2hex(bin.slice(-16,-12));\n    return crc;\n}\n\nconsole.log(getUUID(\"https://www.baidu.com/\"));</code></pre><p>文章引用： <a href=\"https://www.cnblogs.com/leijing0607/p/8044218.html\" target=\"_blank\">https://www.cnblogs.com/leijing0607/p/8044218.html</a> </p>', 'Canvas指纹\n 从根本上来说，每一种浏览器都会使用不同的图像处理引擎，不同的导出选项，不同的压缩等级，所以每一台电脑绘制出的图形都会有些许不同，这些图案可以被用来给用户设备分配特定编号（指纹），也就是说可以用来识别不同用户。\n\nfunction bin2hex(s) {\n  var i, l, o = \'\',\n    n;\n\n  s += \'\';\n\n  for (i = 0, l = s.length; i < l; i++) {\n    n = s.charCodeAt(i)\n      ', '2025/02/16/a79d850c-9171-42c1-beb8-acc1d0bb4b61.webp', 1, 'qxfly', '2025-03-03 19:13:16', '2025-03-03 19:13:16', 3, 1, 1, 'JavaScript', 3, '编程', 11);
INSERT INTO `article` VALUES (152, 'Linux zip、tar压缩命令', '<h2 style=\"text-align: start;\">一、zip命令</h2><h3 style=\"text-align: start;\">1.1. 压缩文件或目录</h3><ul><li style=\"text-align: start;\">基本用法：</li></ul><pre><code >zip 压缩包名称.zip 要压缩的文件或目录</code></pre><p style=\"text-align: start;\"> 如果指定的是目录，默认情况下，只会压缩目录中的文件和子目录（但不包括目录本身），并且不会<span style=\"color: rgb(252, 85, 49);\">递归</span>地压缩子目录中的文件。</p><ul><li style=\"text-align: start;\">递归压缩目录：为了递归地压缩目录及其所有子目录和文件，需要使用 -r（或 --recurse-paths）参数：</li></ul><pre><code >zip -r 压缩包名称.zip 要压缩的目录</code></pre><h3 style=\"text-align: start;\">1.2. 解压文件</h3><ul><li style=\"text-align: start;\">基本用法：</li></ul><pre><code >unzip 压缩包名称.zip</code></pre><p style=\"text-align: start;\"> 这个命令会将压缩包中的所有文件和目录解压到当前目录下。</p><h2 style=\"text-align: start;\">二、tar命令</h2><h3 style=\"text-align: start;\">1.1. 压缩文件</h3><pre><code >tar -czvf 压缩包名称.tar.gz 要压缩的文件或目录</code></pre><p style=\"text-align: start;\">可选项如下：</p><ul><li style=\"text-align: start;\">-c：创建一个新的归档文件。</li><li style=\"text-align: start;\">-z：通过 gzip 进行压缩或解压缩。</li><li style=\"text-align: start;\">-v：在处理文件时显示详细信息（verbose模式）。</li><li style=\"text-align: start;\">-f：指定归档文件的名称。注意 -f 选项应该放在所有其他选项之后，紧跟归档文件名。</li></ul><h3 style=\"text-align: start;\">1.2. 解压文件</h3><pre><code >tar -xzvf 压缩包名称.tar.gz -C 解压目录</code></pre><p style=\"text-align: start;\">可选项如下：</p><ul><li style=\"text-align: start;\">-x：从归档文件中提取文件。</li><li style=\"text-align: start;\">-z：同上，指定 gzip 处理压缩文件。</li><li style=\"text-align: start;\">-v：同上，显示详细信息。</li><li style=\"text-align: start;\">-f：同上，指定归档文件的名称。</li><li style=\"text-align: start;\">-C：指定解压文件的目标目录。</li></ul><p style=\"text-align: start;\">注意，如果解压目录不存在，可能需要先创建该目录。</p><p><br></p>', '一、zip命令\n1.1. 压缩文件或目录\n基本用法：\nzip 压缩包名称.zip 要压缩的文件或目录\n 如果指定的是目录，默认情况下，只会压缩目录中的文件和子目录（但不包括目录本身），并且不会递归地压缩子目录中的文件。\n递归压缩目录：为了递归地压缩目录及其所有子目录和文件，需要使用 -r（或 --recurse-paths）参数：\nzip -r 压缩包名称.zip 要压缩的目录\n1.2. 解压文件\n基本用法：\nunzip 压缩包名称.zip\n 这个命令会将压缩包中的所有文件和目录解压到当前目录下', '2025/02/16/13fbaef9-4c7e-46c0-9a42-da756480433e.webp', 1, 'qxfly', '2025-03-11 23:13:31', '2025-03-11 23:13:31', 7, 0, 0, 'Linux', 3, '教程', 11);
INSERT INTO `article` VALUES (159, 'js给背景图片深浅动态增加遮罩，以更好显示字体', '<h2><strong>1、新建canvas</strong></h2><pre><code class=\"language-html\"> &lt;canvas id=\"article-header-cover-canvas\" style=\"display: none\"&gt;&lt;/canvas&gt;</code></pre><h2>2、获取图片，增加遮罩</h2><pre><code class=\"language-javascript\">/* 根据背景的深浅，调整字体颜色 */\nlet brightnessValue = 1; // 图片遮罩亮度\nfunction setThemeColor() {\n    let img = new Image();\n    let canvas = document.getElementById(\"article-header-cover-canvas\");\n    let ctx = canvas.getContext(\"2d\");\n    img.onload = function () {\n        ctx.drawImage(img, 0, 0);\n        img.style.display = \"none\";\n        let imgData = ctx.getImageData(0, 0, img.width, img.height).data;\n        // 存储颜色及其像素数的对象数组\n        var colorCounts = {};\n        // 遍历每个像素，统计颜色出现次数\n        for (var i = 0; i &lt; imgData.length; i += 4) {\n            var rgba = +imgData[i] + \",\" + imgData[i + 1] + \",\" + imgData[i + 2];\n\n            if (rgba in colorCounts) {\n                colorCounts[rgba]++;\n            } else {\n                colorCounts[rgba] = 1;\n            }\n        }\n        // 根据像素数对颜色进行排序\n        var sortedColors = Object.keys(colorCounts).sort(function (a, b) {\n            return colorCounts[b] - colorCounts[a];\n        });\n        let mainColor = sortedColors.slice(1, 4);\n        let rgbs = [];\n        let lights = [];\n        for (let i = 0; i &lt; mainColor.length; i++) {\n            let rgb = mainColor[i].split(\",\");\n            rgb[0] = rgb[0] / 255;\n            rgb[1] = rgb[1] / 255;\n            rgb[2] = rgb[2] / 255;\n            rgbs.push(rgb);\n            lights.push(rgb[0] * 0.3 + rgb[1] * 0.59 + rgb[2] * 0.11);\n        }\n        brightnessValue = (lights[0] + lights[1] + lights[2]) / 3;\n        if (brightnessValue &gt; 0.5) {\n            brightnessValue = 1 - brightnessValue / 2;\n        } else {\n            brightnessValue = 0.5 + brightnessValue;\n        }\n        const cover = document.getElementById(\"article-header-cover\"); //获取图片\n        cover.style.filter = \"blur(5px) brightness(\" + brightnessValue + \")\"; // 设置亮度\n    };\n    img.src = article.value.cover;\n    img.crossOrigin = \"Anonymous\";\n}</code></pre><p><strong>未增加遮罩：</strong></p><p><img src=\"https://qxfly.xyz/fly/articleImage/2025/01/31/717a2497-5a71-41c6-98a3-852774901d1b.png\" alt=\"image\" data-href=\"https://qxfly.xyz/fly/articleImage/2025/01/31/717a2497-5a71-41c6-98a3-852774901d1b.png\" style=\"width: 100%;\"/></p><p><strong>增加遮罩：</strong><img src=\"https://qxfly.xyz/fly/articleImage/2025/01/31/3c24f134-a132-413f-a7a5-fd6a98f6c7be.png\" alt=\"image\" data-href=\"http://38.55.199.233:8081/articleImage/2025/01/31/3c24f134-a132-413f-a7a5-fd6a98f6c7be.png\" style=\"width: 100%;\"/></p><p><br></p>', '1、新建canvas\n <canvas id=\"article-header-cover-canvas\" style=\"display: none\"></canvas>\n2、获取图片，增加遮罩\n/* 根据背景的深浅，调整字体颜色 */\nlet brightnessValue = 1; // 图片遮罩亮度\nfunction setThemeColor() {\n    let img = new Image();\n    let canvas = document.getElementById(\"a', '2025/05/11/aa6927cb-f399-41ec-abaf-b67bf1d52493.webp', 1, 'qxfly', '2025-03-31 16:41:08', '2025-05-11 13:17:20', 7, 1, 1, 'JavaScript', 3, '编程', 11);
INSERT INTO `article` VALUES (160, 'Ubantu 22解压安装nginx，并设置服务和开机自启', '<h4 style=\"text-align: start;\">1、依赖配置安装</h4><blockquote style=\"text-align: start;\">sudo apt install gcc make libpcre3-dev zlib1g-dev openssl libssl-dev</blockquote><p style=\"text-align: start;\"><br></p><h4 style=\"text-align: start;\">2、如果未编译安装则生成编译脚本，否则直接跳过2 3 4步</h4><blockquote style=\"text-align: start;\">./configure --prefix=/usr/local/nginx --with-http_ssl_module</blockquote><h4 style=\"text-align: start;\">3、编译</h4><blockquote style=\"text-align: start;\">make</blockquote><h4 style=\"text-align: start;\">4、开始安装</h4><blockquote style=\"text-align: start;\">make install</blockquote><p style=\"text-align: start;\"><br></p><h4 style=\"text-align: start;\">7、设置为随机自启动</h4><h5 style=\"text-align: start;\">7.1、创建 nginx.service 文件，将以下内容粘贴到文件中</h5><p style=\"text-align: start;\">路径中的\"usr/local\"替换成自己的路径。</p><pre style=\"text-align: left;\"><code>Description=nginx - high performance web server\nAfter=network.target remote-fs.target nss-lookup.target\n[Service]\nType=forking\nExecStart=/usr/local/nginx/sbin/nginx -c /usr/local/nginx/conf/nginx.conf\nExecReload=/usr/local/nginx/sbin/nginx -s reload\nExecStop=/usr/local/nginx/sbin/nginx -s stop\n[Install]\nWantedBy=multi-user.target</code></pre><h5 style=\"text-align: start;\">7.2、将 nginx.service 放入 /etc/systemd/system/ 下,并授权</h5><blockquote style=\"text-align: start;\">chmod 777 nginx.service</blockquote><h5 style=\"text-align: start;\">7.3、配置重新加载</h5><blockquote style=\"text-align: start;\">systemctl daemon-reload</blockquote><h5 style=\"text-align: start;\">7.4、开启Nginx随机自启服务</h5><blockquote style=\"text-align: start;\">systemctl enable nginx.service</blockquote><h5 style=\"text-align: start;\">7.5、 启动Nginx</h5><blockquote style=\"text-align: start;\">systemctl start nginx.service</blockquote><h5 style=\"text-align: start;\">7.6、查看服务状态</h5><blockquote style=\"text-align: start;\">systemctl status nginx.service</blockquote><p><br></p>', '1、依赖配置安装\nsudo apt install gcc make libpcre3-dev zlib1g-dev openssl libssl-dev\n\n2、如果未编译安装则生成编译脚本，否则直接跳过2 3 4步\n./configure --prefix=/usr/local/nginx --with-http_ssl_module\n3、编译\nmake\n4、开始安装\nmake install\n\n7、设置为随机自启动\n7.1、创建 nginx.service 文件，将以下内容粘贴到文件中\n路径', '2025/03/18/35cf5f7a-2deb-48f5-900d-77038d554f87.webp', 1, 'qxfly', '2025-04-02 20:58:27', '2025-04-02 20:58:27', 5, 0, 0, 'Ubuntu,Linux,操作系统', 3, '编程', 11);
INSERT INTO `article` VALUES (161, 'Java调用基于Ollama本地大模型', '<h4 style=\"text-align: start;\">1. pom.xml设置</h4><p style=\"text-align: start;\">我们设置我们的pom.xml中的内容如下</p><pre style=\"text-align: start;\"><code class=\"language-xml\">&lt;?xml version=\"1.0\" encoding=\"UTF-8\"?&gt;\n&lt;project xmlns=\"http://maven.apache.org/POM/4.0.0\"\n         xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n         xsi:schemaLocation=\"http://maven.apache.org/POM/4.0.0 http://maven.apache.org/xsd/maven-4.0.0.xsd\"&gt;\n    &lt;modelVersion&gt;4.0.0&lt;/modelVersion&gt;\n    &lt;parent&gt;\n        &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n        &lt;artifactId&gt;spring-boot-starter-parent&lt;/artifactId&gt;\n        &lt;version&gt;3.2.5&lt;/version&gt;\n        &lt;relativePath/&gt; &lt;!-- lookup parent from repository --&gt;\n    &lt;/parent&gt;\n    &lt;groupId&gt;org.example&lt;/groupId&gt;\n    &lt;artifactId&gt;testAI&lt;/artifactId&gt;\n    &lt;version&gt;1.0-SNAPSHOT&lt;/version&gt;\n\n    &lt;properties&gt;\n        &lt;maven.compiler.source&gt;17&lt;/maven.compiler.source&gt;\n        &lt;maven.compiler.target&gt;17&lt;/maven.compiler.target&gt;\n        &lt;java.version&gt;17&lt;/java.version&gt;\n        &lt;project.build.sourceEncoding&gt;UTF-8&lt;/project.build.sourceEncoding&gt;\n    &lt;/properties&gt;\n    &lt;dependencies&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-boot-starter-web&lt;/artifactId&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;io.springboot.ai&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-ai-ollama-spring-boot-starter&lt;/artifactId&gt;\n            &lt;version&gt;1.0.0&lt;/version&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-boot-devtools&lt;/artifactId&gt;\n            &lt;scope&gt;runtime&lt;/scope&gt;\n            &lt;optional&gt;true&lt;/optional&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.projectlombok&lt;/groupId&gt;\n            &lt;artifactId&gt;lombok&lt;/artifactId&gt;\n            &lt;optional&gt;true&lt;/optional&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-boot-starter-test&lt;/artifactId&gt;\n            &lt;scope&gt;test&lt;/scope&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.springframework&lt;/groupId&gt;\n            &lt;artifactId&gt;spring-web&lt;/artifactId&gt;\n            &lt;version&gt;6.1.6&lt;/version&gt;\n        &lt;/dependency&gt;\n    &lt;/dependencies&gt;\n    &lt;build&gt;\n        &lt;plugins&gt;\n            &lt;plugin&gt;\n                &lt;groupId&gt;org.springframework.boot&lt;/groupId&gt;\n                &lt;artifactId&gt;spring-boot-maven-plugin&lt;/artifactId&gt;\n                &lt;configuration&gt;\n                    &lt;excludes&gt;\n                        &lt;exclude&gt;\n                            &lt;groupId&gt;org.projectlombok&lt;/groupId&gt;\n                            &lt;artifactId&gt;lombok&lt;/artifactId&gt;\n                        &lt;/exclude&gt;\n                    &lt;/excludes&gt;\n                &lt;/configuration&gt;\n            &lt;/plugin&gt;\n        &lt;/plugins&gt;\n    &lt;/build&gt;\n    &lt;repositories&gt;\n        &lt;repository&gt;\n            &lt;id&gt;spring-milestones&lt;/id&gt;\n            &lt;name&gt;Spring Milestones&lt;/name&gt;\n            &lt;url&gt;https://repo.spring.io/milestone&lt;/url&gt;\n            &lt;snapshots&gt;\n                &lt;enabled&gt;false&lt;/enabled&gt;\n            &lt;/snapshots&gt;\n        &lt;/repository&gt;\n    &lt;/repositories&gt;\n&lt;/project&gt;\n</code></pre><h4 style=\"text-align: start;\">2. application.properties设置</h4><p style=\"text-align: start;\">我们设置我们的application.properties中的内容如下</p><blockquote style=\"text-align: start;\">server.port=8099spring.ai.ollama.base-url=http://10.31.128.110:9999spring.ai.ollama.chat.options.model=Qwen2-7b:latest</blockquote><p style=\"text-align: start;\">其中上述的内容中spring.ai.ollama.base-url为你本地使用ollama搭建的大模型地址，spring.ai.ollama.chat.options.model则是你在文档搭建的大模型名称</p><h4 style=\"text-align: start;\">3. application启动设置</h4><p style=\"text-align: start;\">我们设置testAiApplication主程序启动的代码如下</p><pre style=\"text-align: start;\"><code class=\"language-java\">package org.example;\n\nimport org.springframework.boot.SpringApplication;\nimport org.springframework.boot.autoconfigure.SpringBootApplication;\nimport org.springframework.scheduling.annotation.EnableAsync;\n\n@EnableAsync\n@SpringBootApplication\npublic class testAiApplication {\n    public static void main(String[] args) {\n        SpringApplication.run(testAiApplication.class, args);\n    }\n}\n</code></pre><h4 style=\"text-align: start;\">4. 接口暴露</h4><p style=\"text-align: start;\">我们编写aiController暴露对应的接口内容</p><pre style=\"text-align: start;\"><code class=\"language-java\">package org.example.controller;\n\nimport org.springframework.ai.ollama.OllamaChatClient;\nimport org.springframework.beans.factory.annotation.Autowired;\nimport org.springframework.beans.factory.annotation.Qualifier;\nimport org.springframework.web.bind.annotation.GetMapping;\nimport org.springframework.web.bind.annotation.RequestParam;\nimport org.springframework.web.bind.annotation.RestController;\n\n@RestController\npublic class aiController {\n\n    @Autowired\n    @Qualifier(\"ollamaChatClient\")\n    private OllamaChatClient  ollamaChatClient;\n    @GetMapping(\"/ollama/chat/v1\")\n    public String ollamaChat(@RequestParam String msg) {\n        return this.ollamaChatClient.call(msg);\n    }\n}\n</code></pre><h4 style=\"text-align: start;\">5. 程序启动</h4><p style=\"text-align: start;\">编写好对应的代码以后，我们可以启动我们的程序</p><blockquote style=\"text-align: start;\">2024-09-18T15:10:34.292+08:00 INFO 16896 — [ restartedMain] o.s.b.w.embedded.tomcat.TomcatWebServer : Tomcat started on port 8099 (http) with context path ‘’2024-09-18T15:10:34.328+08:00 INFO 16896 — [ restartedMain] org.example.testAiApplication : Started testAiApplication in 7.331 seconds (process running for 8.44)</blockquote><p><u>来源： </u><a href=\"https://blog.csdn.net/u012151594/article/details/142335334\" target=\"_blank\"><u>https://blog.csdn.net/u012151594/article/details/142335334</u></a><u> </u></p>', '1. pom.xml设置\n我们设置我们的pom.xml中的内容如下\n<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<project xmlns=\"http://maven.apache.org/POM/4.0.0\"\n         xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"\n         xsi:schemaLocation=\"http://maven.apache.org/POM/4.0.0 ', '2025/03/18/cb28ac06-02a4-4553-9538-3d604a9be3a7.webp', 1, 'qxfly', '2025-04-02 23:00:26', '2025-04-02 23:00:26', 7, 0, 0, '人工智能,SpringBoot,Java', 3, 'AI', 11);
INSERT INTO `article` VALUES (163, 'windows使用docker下载安装Redis', '<p><strong>1、打开cmd输入一下命令下载最新版:</strong></p><pre><code >docker pull redis</code></pre><p><strong> &nbsp; &nbsp;如果想指定版本</strong></p><pre><code >docker pull redis:5.0</code></pre><p><strong>2、通过以下命令查看已下载镜像</strong></p><pre><code class=\"language-java\">docker images</code></pre><p><strong>3、安装 redis容器</strong></p><pre><code >docker run --name myredis -it -p 6379:6379 -v /data/redis-data  redis --requirepass \"123456\"</code></pre><ul><li style=\"text-align: start;\">最后的redis表示Redis镜像名</li><li style=\"text-align: start;\">–name:容器名称</li><li style=\"text-align: start;\">-p 6379:6379 将端口设置为6379</li><li style=\"text-align: start;\">-it参表示控制台显示Redis安装的交互信息，如果后台运行，用-d参数</li><li style=\"text-align: start;\">-v /data/redis-data 将redis数据挂载到根目录的 /data/redis-data 目录下</li><li style=\"text-align: start;\">-v $PWD/data/redis-data 将redis数据挂载到当前目录的data/redis-data 目录下</li><li style=\"text-align: start;\">–requitepass “123456” : 指定redis连接密码，此参数要放在镜像名后面</li></ul><p style=\"text-align: start;\"><strong>4、查看已安装的容器</strong></p><pre><code >docker ps -a</code></pre><p style=\"text-align: start;\"><strong>5、启动myredis容器</strong></p><pre><code >docker start 容器id</code></pre><p style=\"text-align: start;\"><strong>6、如果要开始Redis持久化，需要用下面的方式创建redis容器</strong></p><p style=\"text-align: start;\">linux环境如下：</p><pre><code >docker run -d --name redis-server -p 6379:6379 -v /usr/redis/redis.conf:/etc/redis/redis.conf -v /usr/redis/data/:/data redis:latest /etc/redis/redis.conf --appendonly yes --requirepass \"123456\"</code></pre><p>win环境如下：</p><pre><code >docker run -p 6379:6379 --name redis1 -v F:\\Code\\redis\\conf\\redis.config:/etc/redis/redis.config -v F:\\Code\\redis\\data:/var/lib/redis -v F:\\Code\\redis\\logs:/logs -d redis:latest</code></pre><ul><li style=\"text-align: start;\">在/usr/redis新建文件夹，拷贝redis.conf配置文件，建data文件夹保存redis持久化数据</li><li style=\"text-align: start;\">-v 挂载目录，本机目录文件:容器内目录文件，</li><li style=\"text-align: start;\">/etc/redis/redis.conf 关键配置，让redis以指定的配置文件启动，而不是默认无配置启动</li><li style=\"text-align: start;\">–appendonly yes redis启动后开启数据持久化</li><li style=\"text-align: start;\">--requirepas 密码</li></ul><p style=\"text-align: start;\"><em>如果启动失败参考win环境的命令格式把redis:latest后面的/etc/redis/redis.conf删掉</em></p><p style=\"text-align: start;\"><strong>7、运行redis-cli，连接到redis服务，如果Redis有设置密码，需要带-a参数</strong></p><pre><code >docker exec -it myredis redis-cli</code></pre><pre><code >docker exec -it myredis redis-cli -a \"your password\"</code></pre><p style=\"text-align: start;\">这时会生产警告信息，但是已经连接成功了。</p><p style=\"text-align: start;\">redis-cli客户端连接redis成功之后，用set与get命令验证。</p><p style=\"text-align: start;\">添加与获取reids缓存</p><pre><code >set name \"qxfly\"</code></pre><pre><code >get name</code></pre><p><strong>8、可视化</strong></p><p>使用<a href=\"https://github.com/qishibo/AnotherRedisDesktopManager\" target=\"_blank\">AnotherRedisDesktopManager</a>进行可视化管理</p><p>链接： <a href=\"https://github.com/qishibo/AnotherRedisDesktopManager\" target=\"_blank\">https://github.com/qishibo/AnotherRedisDesktopManager</a> </p><p><br></p>', '1、打开cmd输入一下命令下载最新版:\ndocker pull redis\n    如果想指定版本\ndocker pull redis:5.0\n2、通过以下命令查看已下载镜像\ndocker images\n3、安装 redis容器\ndocker run --name myredis -it -p 6379:6379 -v /data/redis-data  redis --requirepass \"123456\"\n最后的redis表示Redis镜像名\n–name:容器名称\n-p 6379:6379', '2025/03/18/a27b492f-5be5-400d-b723-895a201d7240.webp', 1, 'qxfly', '2025-04-11 23:21:13', '2025-04-11 23:21:13', 7, 0, 0, '后端,软件使用,学习和成长,Java', 3, '教程', 11);
INSERT INTO `article` VALUES (164, 'C++ 7种位运算的详细特性和示例：', '<p style=\"text-align: start;\"><strong>1、与运算（AND）：</strong></p><ul><li style=\"text-align: start;\">任何数和0做与运算，结果是0，即 x &amp; 0 = 0。例如，5（101） &amp; 0 = 0。</li><li style=\"text-align: start;\">任何数和其自身做与运算，结果是自身，即 x &amp; x = x。例如，5（101） &amp; 5（101） = 5（101）。</li></ul><p style=\"text-align: start;\"><strong>2、或运算（OR）：</strong></p><ul><li style=\"text-align: start;\">任何数和0做或运算，结果是自身，即 x | 0 = x。例如，5（101） | 0 = 5（101）。</li><li style=\"text-align: start;\">任何数和其自身做或运算，结果是自身，即 x | x = x。例如，5（101） | 5（101） = 5（101）。</li></ul><p style=\"text-align: start;\"><strong>3、异或运算（XOR）：</strong></p><ul><li style=\"text-align: start;\">任何数和0做异或运算，结果是自身，即 x ^ 0 = x。例如，5（101） ^ 0 = 5（101）。</li><li style=\"text-align: start;\">任何数和其自身做异或运算，结果是0，即 x ^ x = 0。例如，5（101） ^ 5（101） = 0。</li><li style=\"text-align: start;\">异或运算满足交换律和结合律，即 a ^ b ^ c = a ^ (b ^ c) = (a ^ b) ^ c。例如，5（101） ^ 3（011） ^ 4（100） = 5 ^ (3 ^ 4) = (5 ^ 3) ^ 4。</li></ul><p style=\"text-align: start;\"><strong>4、非运算（NOT）：</strong></p><ul><li style=\"text-align: start;\">非运算会反转操作数的所有位。例如，~5（101） = 2（010）。</li></ul><p style=\"text-align: start;\"><strong>5、左移运算（SHL）：</strong></p><ul><li style=\"text-align: start;\">左移n位等于乘以2的n次方，即 x &lt;&lt; n = x * 2^n。例如，5（101） &lt;&lt; 2 = 20（10100）。</li><li style=\"text-align: start;\">左移运算不改变操作数的符号位。</li></ul><p style=\"text-align: start;\"><strong>6、逻辑右移运算（SHR）：</strong></p><ul><li style=\"text-align: start;\">右移n位等于除以2的n次方，即 x &gt;&gt; n = x / 2^n。例如，20（10100） &gt;&gt; 2 = 5（101）。</li><li style=\"text-align: start;\">逻辑右移运算会用0填充移位后产生的空位。</li></ul><p style=\"text-align: start;\"><strong>7、算术右移运算（SAR）：</strong></p><ul><li style=\"text-align: start;\">算术右移运算会用符号位填充移位后产生的空位，因此它可以保持负数的符号。例如，对于负数-5（1011） &gt;&gt;&gt; 2 = -2（1110）。</li></ul>', '1、与运算（AND）：\n任何数和0做与运算，结果是0，即 x & 0 = 0。例如，5（101） & 0 = 0。\n任何数和其自身做与运算，结果是自身，即 x & x = x。例如，5（101） & 5（101） = 5（101）。\n2、或运算（OR）：\n任何数和0做或运算，结果是自身，即 x | 0 = x。例如，5（101） | 0 = 5（101）。\n任何数和其自身做或运算，结果是自身，即 x | x = x。例如，5（101） | 5（101） = 5（101）。\n3、异或运算（XOR）', '2025/03/18/6ccf8fff-3213-4da7-a6a5-05a90728710c.webp', 1, 'qxfly', '2025-04-12 16:57:27', '2025-05-14 13:42:30', 10, 2, 2, 'C/C++,数据结构,学习和成长', 1, '学习和成长', 11);
INSERT INTO `article` VALUES (165, 'Java学习记录：导入lombok依赖', '<p>1、导入依赖</p><pre><code >&lt;dependencies&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.projectlombok&lt;/groupId&gt;\n            &lt;artifactId&gt;lombok&lt;/artifactId&gt;\n            &lt;version&gt;1.18.30&lt;/version&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.slf4j&lt;/groupId&gt;\n            &lt;artifactId&gt;slf4j-api&lt;/artifactId&gt;\n            &lt;version&gt;1.7.36&lt;/version&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;org.slf4j&lt;/groupId&gt;\n            &lt;artifactId&gt;slf4j-log4j12&lt;/artifactId&gt;\n            &lt;version&gt;1.7.12&lt;/version&gt;\n        &lt;/dependency&gt;\n        &lt;dependency&gt;\n            &lt;groupId&gt;log4j&lt;/groupId&gt;\n            &lt;artifactId&gt;log4j&lt;/artifactId&gt;\n            &lt;version&gt;1.2.17&lt;/version&gt;\n        &lt;/dependency&gt;\n&lt;/dependencies&gt;</code></pre><p>2、编写配置文件 log4j.properties</p><pre><code ># Configure logging for testing: optionally with log file\nlog4j.rootLogger=info, stdout, logfile\n# log4j.rootLogger=WARN, stdout, logfile\n\nlog4j.appender.stdout=org.apache.log4j.ConsoleAppender\nlog4j.appender.stdout.layout=org.apache.log4j.PatternLayout\nlog4j.appender.stdout.layout.ConversionPattern=%d %p [%c] - %m%n\n\n# 配置logfile输出到文件中 文件大小到达指定尺寸的时候产生新的日志文件\nlog4j.appender.logfile=org.apache.log4j.RollingFileAppender\n# 保存编码格式\nlog4j.appender.logfile.Encoding=UTF-8\n# 输出文件位置此为项目根目录下的logs文件夹中\nlog4j.appender.logfile.File=logs/root.log\n# 后缀可以是KB,MB,GB达到该大小后创建新的日志文件\nlog4j.appender.logfile.MaxFileSize=10MB\n# 设置滚定文件的最大值3 指可以产生root.log.1、root.log.2、root.log.3和root.log四个日志文件\nlog4j.appender.logfile.MaxBackupIndex=3  \n# 配置logfile为自定义布局模式\nlog4j.appender.logfile.layout=org.apache.log4j.PatternLayout\nlog4j.appender.logfile.layout.ConversionPattern=%d{yyyy-MM-dd HH:mm:ss} %F %p %m%n\n</code></pre><p><br></p>', '1、导入依赖\n<dependencies>\n        <dependency>\n            <groupId>org.projectlombok</groupId>\n            <artifactId>lombok</artifactId>\n            <version>1.18.30</version>\n        </dependency>\n        <dependency>\n            <groupId>org.slf4j</', '2025/03/18/7efcd173-23a1-4997-a617-2d56e7c18444.webp', 1, 'qxfly', '2025-04-15 21:04:20', '2025-04-15 21:04:20', 7, 2, 5, '后端,Java', 3, '编程', 11);
INSERT INTO `article` VALUES (176, '书页间，我的灵魂蜕变之旅', '<blockquote style=\"text-align: start;\">读书于我而言，是一场与自我、与世界不断对话的奇妙旅程，其间有欢笑、有泪水，更有困惑后的顿悟与成长。</blockquote><p style=\"text-align: start;\">最初，我读书不过是随性而为，像一只在花丛中乱飞的蝴蝶，没有明确的方向。偶然读到一本武侠小说，那快意恩仇的江湖、跌宕起伏的情节，瞬间将我俘获。我跟着主角一起闯荡江湖，为他们的胜利欢呼，为他们的失败扼腕。那时的我，沉浸在故事的精彩之中，只图一时的感官刺激，就像在吃一顿美味的快餐，填饱了肚子，却没留下多少营养。</p><p style=\"text-align: start;\">后来，生活给了我重重一击。工作上的挫折、人际关系的困扰，像一团乌云，将我紧紧笼罩。我感到迷茫、无助，仿佛置身于黑暗的深渊，找不到出路。就在我几乎要被绝望吞噬的时候，我随手翻开了一本哲学书籍。起初，那些深奥的理论、晦涩的语句，像一道道难以跨越的沟壑，横亘在我面前。我读得艰难，甚至想要放弃，但心中的苦闷又让我舍不得放下。</p><p style=\"text-align: start;\">在无数个辗转反侧的夜晚，我一次次地翻开那本书，逐字逐句地研读。慢慢地，我开始理解那些文字背后的含义，仿佛在黑暗中看到了一丝曙光。哲学家的思想，像一把把利剑，刺破了我心中的阴霾。我开始反思自己的行为和思维方式，意识到很多问题其实源于自己的认知局限。就像尼采说的“那些杀不死你的，终将使你变得更强大”，我明白了挫折是成长的必经之路，不能一味地抱怨和逃避。那一刻，我心中涌起一股复杂的情感，有对过去自己的懊悔，也有对未来重新燃起的希望。</p><p style=\"text-align: start;\">随着阅读量的增加，我接触到了更多不同类型的书籍。读文学名著时，我仿佛穿越时空，与作者和书中的人物进行了一场跨越世纪的对话。我跟随简·爱的脚步，感受她对平等和自由的执着追求，明白了尊严和独立的重要性；我与鲁滨逊一起在荒岛上求生，体会到了他在困境中不屈不挠的精神，懂得了在面对困难时要保持乐观和坚强。这些人物的故事，像一面面镜子，映照出我自己的优点和不足，让我不断审视自己，努力成为更好的人。</p><p style=\"text-align: start;\">然而，读书的过程并非总是一帆风顺。有时候，我会对书中的观点产生质疑，觉得与自己的认知相悖。这种困惑让我陷入了深深的思考，我开始查阅资料、与他人讨论，试图找到一个合理的解释。在这个过程中，我学会了独立思考，不盲目跟从他人的观点。就像在学术的海洋中航行，虽然会遇到风浪，但每一次的探索和思考，都让我离真理更近一步。</p><p style=\"text-align: start;\">读书也改变了我的表达方式。曾经，我在与人交流时，总是词不达意，无法准确表达自己的想法。而现在，因为阅读了大量的书籍，我的词汇量丰富了，思维也更加敏捷。我能够用更准确、更生动的语言来表达自己的观点，与人沟通也变得更加顺畅。这种变化不仅让我在社交场合中更加自信，也让我在工作上得到了更多的认可。</p><p style=\"text-align: start;\">回顾这段读书的经历，我深刻地感受到自己从一个懵懂无知、随波逐流的人，逐渐成长为一个有思想、有主见、能够独立思考的人。读书就像一场春雨，滋润了我干涸的心灵；又像一座灯塔，在茫茫的人生海洋中为我指引方向。</p><p style=\"text-align: start;\">未来，我还会继续在这书页间徘徊、探索。因为我知道，每一次的阅读都是一次心灵的洗礼，每一次的思考都是一次自我的成长。我会带着从书中汲取的智慧和力量，勇敢地面对生活中的挑战，不断书写属于自己的精彩人生。</p>', '读书于我而言，是一场与自我、与世界不断对话的奇妙旅程，其间有欢笑、有泪水，更有困惑后的顿悟与成长。\n最初，我读书不过是随性而为，像一只在花丛中乱飞的蝴蝶，没有明确的方向。偶然读到一本武侠小说，那快意恩仇的江湖、跌宕起伏的情节，瞬间将我俘获。我跟着主角一起闯荡江湖，为他们的胜利欢呼，为他们的失败扼腕。那时的我，沉浸在故事的精彩之中，只图一时的感官刺激，就像在吃一顿美味的快餐，填饱了肚子，却没留下多少营养。\n后来，生活给了我重重一击。工作上的挫折、人际关系的困扰，像一团乌云，将我紧紧笼罩。我感到迷茫', '2025/05/08/ec5549d3-35bf-4a95-981d-f7be75c1248a.webp', 1, 'qxfly', '2025-05-08 13:44:35', '2025-05-14 13:49:38', 1, 0, 0, '感想,阅读,生活', 3, '阅读', 11);
INSERT INTO `article` VALUES (177, '邂逅书香：那些值得反复品读的宝藏书籍', '<p style=\"text-align: start;\">在信息如洪流般奔涌的时代，我们被碎片化的内容裹挟着前行，心灵也愈发渴望一方宁静的精神栖息地。书籍，便是那座永不熄灭的灯塔，在喧嚣尘世中为我们照亮前行的路，给予我们慰藉与力量。今天，就让我为你打开几扇通往不同世界的大门，分享那些让我反复咀嚼、受益匪浅的宝藏书籍。</p><h2 style=\"text-align: start;\">《活着》：在苦难中触摸生命的坚韧</h2><p style=\"text-align: start;\">“人是为了活着本身而活着，而不是为了活着之外的任何事物而活着。”余华用质朴而冷峻的笔触，在《活着》中勾勒出了福贵跌宕起伏的一生。这个曾经的地主少爷，因嗜赌成性输光了家产，从此命运急转直下。在时代的洪流中，他历经内战、三反五反、大跃进、文化大革命等社会变革，身边的亲人一个个离他而去，最后只剩下他和一头老牛相依为命。</p><p style=\"text-align: start;\">初读这本书时，我的内心被深深的悲怆所笼罩，为福贵一次次的失去而痛心疾首。然而，随着阅读的深入，我渐渐从这无尽的苦难中感受到了一种震撼人心的力量。福贵在面对生活的重重打击时，从未放弃过活着的信念。他默默承受着一切，用坚韧和豁达诠释着生命的意义。这本书就像一面镜子，让我们看到了生活的残酷，也让我们明白了，无论命运多么不公，无论生活多么艰难，只要我们还能呼吸，就应珍惜当下，努力活着。</p><h2 style=\"text-align: start;\">《百年孤独》：魔幻与现实交织的家族史诗</h2><p style=\"text-align: start;\">加西亚·马尔克斯的《百年孤独》，宛如一幅绚丽多彩又神秘莫测的画卷，将布恩迪亚家族七代人的传奇故事与马孔多小镇的兴衰变迁娓娓道来。书中充满了奇幻的想象和魔幻的元素，会飞的床单、长着猪尾巴的孩子、下了四年十一个月零两天的大雨……这些看似荒诞不经的情节，却与现实紧密相连，深刻地反映了拉丁美洲的历史、文化和社会现实。</p><p style=\"text-align: start;\">当我沉浸在这个光怪陆离的世界里时，仿佛置身于一场盛大的梦境之中。我随着布恩迪亚家族的成员们一起欢笑、一起悲伤，感受着他们的孤独与迷茫。在这个家族中，每个人都在努力寻找自己的存在价值，却又始终无法摆脱孤独的宿命。读完这本书，我不禁陷入了沉思：孤独，或许是人类永恒的主题，我们每个人都在自己的世界里孤独地前行。但正是这种孤独，让我们更加深刻地思考人生的意义，更加珍惜与他人的情感连接。</p><h2 style=\"text-align: start;\">《小王子》：用纯真治愈心灵的童话</h2><p style=\"text-align: start;\">《小王子》是一本写给大人看的童话书。圣埃克苏佩里以小王子离开自己的星球、在宇宙中旅行的经历为线索，用简洁而富有哲理的语言，讲述了一个个关于爱、友谊、责任和成长的故事。小王子在各个星球上遇到了各种各样古怪的人，有自命不凡的国王、爱慕虚荣的人、酒鬼、商人、点灯人和地理学家。他们的行为看似荒诞，却反映了成人世界的种种弊病。</p><p style=\"text-align: start;\">而小王子与狐狸之间的友谊，以及他对玫瑰花的深情，则让我们感受到了爱的纯真与美好。狐狸告诉小王子：“重要的东西，用眼睛是看不见的，只有用心才能看得清楚。”这句话如同一束光，照亮了我们内心深处那些被遗忘的角落。在这个物欲横流的社会里，我们常常被功名利禄所迷惑，忽略了身边真正重要的东西。而《小王子》就像一位温柔的导师，用纯真的故事唤醒我们内心深处的善良与爱，让我们重新找回那份对生活的热爱和对美好的向往。</p><h2 style=\"text-align: start;\">《人类简史：从动物到上帝》：重新审视人类文明的进程</h2><p style=\"text-align: start;\">尤瓦尔·赫拉利的《人类简史：从动物到上帝》，以其独特的视角和深刻的见解，为我们呈现了一幅波澜壮阔的人类文明发展画卷。书中，作者从认知革命、农业革命到科学革命，详细阐述了人类是如何从一种普通的动物，逐渐成为地球的主宰，并创造出如此辉煌的文明的。</p><p style=\"text-align: start;\">在阅读这本书的过程中，我仿佛站在了历史的长河之上，俯瞰着人类文明的兴衰更替。作者不仅对历史事件进行了生动的描述，还提出了许多令人深思的问题，如农业革命真的是人类的进步吗？科学革命给人类带来了福祉还是灾难？这些问题让我对人类文明的发展有了全新的认识，也让我意识到，我们每个人都是历史长河中的一滴水，我们的行为和选择都将对未来产生深远的影响。这本书就像一把钥匙，打开了我认知世界的新大门，让我以更加宏观和理性的视角看待人类社会。</p><p style=\"text-align: start;\">每一本书都是一座宝藏，等待着我们去挖掘；每一次阅读都是一次心灵的旅行，带领我们穿越时空，领略不同的风景。希望这几本书能够成为你书架上的常客，在你的生命中留下深刻的印记，让你在阅读中遇见更好的自己。现在，不妨放下手中的手机，翻开一本好书，开启一场属于你的精神之旅吧！</p>', '在信息如洪流般奔涌的时代，我们被碎片化的内容裹挟着前行，心灵也愈发渴望一方宁静的精神栖息地。书籍，便是那座永不熄灭的灯塔，在喧嚣尘世中为我们照亮前行的路，给予我们慰藉与力量。今天，就让我为你打开几扇通往不同世界的大门，分享那些让我反复咀嚼、受益匪浅的宝藏书籍。\n《活着》：在苦难中触摸生命的坚韧\n“人是为了活着本身而活着，而不是为了活着之外的任何事物而活着。”余华用质朴而冷峻的笔触，在《活着》中勾勒出了福贵跌宕起伏的一生。这个曾经的地主少爷，因嗜赌成性输光了家产，从此命运急转直下。在时代的洪流中，', '2025/05/08/e22cfa93-78d7-4111-aeec-d493169dbf02.webp', 1, 'qxfly', '2025-05-08 13:45:49', '2025-05-08 13:45:49', 1, 0, 0, '阅读,生活', 3, '阅读', 11);
INSERT INTO `article` VALUES (178, '银幕奇旅：那些值得N刷的宝藏电影推荐', '<p style=\"text-align: start;\">在快节奏生活里，电影宛如一方避风港，让我们短暂逃离琐碎日常，遁入光影交织的奇幻宇宙。每一帧画面、每一段台词、每一个角色，都可能成为触动心灵的钥匙，解锁深藏的情感与思考。今天，就带大家走进几部经典电影，开启一场震撼心灵的银幕之旅。</p><h2 style=\"text-align: start;\">《肖申克的救赎》：希望，是暗夜里的不灭星光</h2><p style=\"text-align: start;\">若说电影史上有哪部作品能如灯塔般照亮无数人的心灵，那《肖申克的救赎》必是其中之一。它没有惊天动地的宏大叙事，没有眼花缭乱的特效奇观，仅凭细腻入微的情感刻画与发人深省的人生哲理，便在影史长河中熠熠生辉。</p><p style=\"text-align: start;\">安迪，一位被冤枉入狱的银行家，在肖申克监狱这座暗无天日的牢笼中，承受着身体与精神的双重折磨。然而，他从未放弃对自由的渴望与对希望的坚守。他用一把小锤子，在漫长的十九年里，一寸一寸地凿通了通往自由的通道。当他在那个风雨交加的夜晚，爬出污水管，张开双臂拥抱大雨时，我仿佛也随着他一同冲破了命运的枷锁，感受到了自由的气息。</p><p style=\"text-align: start;\">这部电影最打动我的，是安迪身上那股不屈不挠的精神。即便身处绝境，他依然保持着对生活的热爱和对未来的憧憬。他帮助狱友学习知识、建立图书馆，用音乐温暖他们冰冷的心。他让我明白，希望是一种力量，无论环境多么恶劣，只要心中有希望，就没有什么能够阻挡我们追求自由的脚步。</p><h2 style=\"text-align: start;\">《千与千寻》：成长，是穿越迷雾的勇敢前行</h2><p style=\"text-align: start;\">宫崎骏的动画电影，总是充满了奇幻的想象与深刻的寓意，《千与千寻》便是其中的经典之作。它宛如一场绮丽的梦境，带我们走进一个神秘而迷人的异世界。</p><p style=\"text-align: start;\">十岁的小女孩千寻，在和父母搬家的途中，意外闯入了一个由神灵掌控的世界。父母因贪吃变成了猪，千寻不得不独自面对这个陌生而危险的世界。在这里，她遇到了形形色色的人物：善良的白龙、贪婪的无脸男、慈祥的锅炉爷爷……在与他们的相处中，千寻逐渐从一个胆小、依赖父母的孩子，成长为一个勇敢、坚强、有担当的少女。</p><p style=\"text-align: start;\">电影中，有许多令人印象深刻的场景。千寻在油屋努力工作的样子，让我看到了她的坚韧与努力；她为了救白龙，不顾危险踏上寻找钱婆婆的旅程，让我感受到了她的善良与勇敢。这部电影不仅是一场视觉盛宴，更是一次关于成长的深刻启示。它告诉我们，成长的过程中会遇到各种各样的困难和挑战，但只要我们保持一颗善良、勇敢的心，就一定能够穿越迷雾，找到属于自己的方向。</p>', '在快节奏生活里，电影宛如一方避风港，让我们短暂逃离琐碎日常，遁入光影交织的奇幻宇宙。每一帧画面、每一段台词、每一个角色，都可能成为触动心灵的钥匙，解锁深藏的情感与思考。今天，就带大家走进几部经典电影，开启一场震撼心灵的银幕之旅。\n《肖申克的救赎》：希望，是暗夜里的不灭星光\n若说电影史上有哪部作品能如灯塔般照亮无数人的心灵，那《肖申克的救赎》必是其中之一。它没有惊天动地的宏大叙事，没有眼花缭乱的特效奇观，仅凭细腻入微的情感刻画与发人深省的人生哲理，便在影史长河中熠熠生辉。\n安迪，一位被冤枉入狱的银', '2025/05/08/3b5a4c55-6e02-469e-9d30-686579a69488.webp', 1, 'qxfly', '2025-05-08 13:49:03', '2025-05-08 13:49:03', 3, 1, 1, '电影推荐,经验分享,感想', 3, '影视', 11);
