INSERT INTO `english_vocabulary` VALUES (5501, 'virtual', '/ˈvɜːrtʃuəl/', 'adj. [计] 虚拟的；实质上的，事实上的（但未在名义上或正式获承认）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5502, 'virus', '/ˈvaɪrəs/', 'n. [病毒] 病毒；恶毒；毒害n. (Virus)人名；(西)比鲁斯', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5503, 'visualize', '/ˈvɪʒuəlaɪz/', 'vt. 形象，形象化；想像，设想vi. 显现', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5504, 'vocal', '/ˈvoʊkl/', 'adj. 歌唱的；声音的，有声的adj. 直言不讳的n. 声乐作品；元音n. Vocal)人名；(西)博卡尔', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5505, 'vocational', '/voʊˈkeɪʃənl/', 'adj. 职业的，行业的', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5506, 'void', '/vɔɪd/', 'adj. 无效的；空的；无人（居住）的；缺乏的n. 空间；空白；空虚感v. 使无效；排放（大小便）n. (Void) （美、俄、印）沃伊德（人名）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5507, 'volunteer', '/ˌvɑːlənˈtɪr/', 'n. 志愿者；志愿兵adj. 志愿的vi. 自愿vt. 自愿', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5508, 'vulgar', '/ˈvʌlɡər/', 'adj. 粗俗的；通俗的；本土的n. 平民，百姓', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5509, 'vulnerable', '/ˈvʌlnərəbl/', 'adj. 易受攻击的，易受……的攻击；易受伤害的；有弱点的', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5510, 'ward', '/wɔːrd/', 'n. 病房；保卫；监视；区，选区vt. 避开；保卫；守护n. （Ward）（英）沃德；（德、芬、瑞典、葡）瓦尔德（人名）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5511, 'warehouse', '/ˈwerhaʊs/', 'n. 仓库；货栈；大商店vt. 储入仓库；以他人名义购进（股票）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5512, 'warfare', '/ˈwɔːrfer/', 'n. 战争；冲突', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5513, 'warrant', '/ˈwɔːrənt/', 'n. 根据；证明；正当理由；委任状vt. 保证；担保；批准；辩解', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5514, 'watertight', '/ˈwɔːtərtaɪt/', 'adj. 水密的；不漏水的；无懈可击的', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5515, 'watt', '/wɑːt/', 'n. 瓦特n. (Watt)人名；(英、葡)瓦特', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5516, 'web', '/web/', 'n. 网；卷筒纸；蹼；织物；圈套vt. 用网缠住；使中圈套vi. 形成网', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5517, 'wedge', '/wedʒ/', 'n. 楔子；楔形物；不和v. 楔入；挤进；楔住n. (Wedge) 韦奇（人名）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5518, 'whereas', '/ˌwerˈæz/', 'conj. 然而；鉴于n. 序言，开场白；条件语句', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5519, 'whereby', '/werˈbaɪ/', 'conj. 凭借；通过…；借以；与…一致adv. 凭此；借以', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5520, 'withhold', '/wɪðˈhəʊld/', 'vt. 保留，不给；隐瞒；抑制vi. 忍住；克制', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5521, 'wrench', '/rentʃ/', 'n. 扳手，扳钳；扭伤；痛苦；歪曲；猛扭vt. 扭伤；猛扭；曲解；折磨vi. 扭伤；猛扭；猛绞n. (Wrench)人名；(英)伦奇', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5522, 'wretched', '/ˈretʃɪd/', 'adj. 可怜的；卑鄙的；令人苦恼或难受的', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5523, 'wrinkle', '/ˈrɪŋkl/', 'n. 皱纹vi. 起皱vt. 使起皱纹', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5524, 'yacht', '/jɑːt/', 'n. 游艇，快艇；轻舟v. 乘游艇，驾游艇；驾帆船比赛n. (Yacht) （美、加、土、法、荷、俄）约特（人名）', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5525, 'yoke', '/joʊk/', 'n. 轭；束缚；牛轭vt. 结合；给…上轭vi. 结合；匹配n. (Yoke)人名；(日)与家(姓)', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5526, 'youngster', '/ˈjʌŋstər/', 'n. 年轻人；少年', 'CET6');
INSERT INTO `english_vocabulary` VALUES (5527, 'zinc', '/zɪŋk/', 'n. 锌；（用于屋顶等的）镀锌铁板v. 镀锌于，用锌处理', 'CET6');
